		"sys": "Getriebe",
		"zs": "Für einige Hochleistungsautos, um die Kraftstoffeffizienz des Autos zu verbessern und die Emissionen zu reduzieren, wenn die Bedingungen erfüllt sind (niedrige Geschwindigkeit, kleines Gaspedal, das Auto wurde aufgewärmt usw.). Das Überspringen-Magnetventil verhindert, dass der Gang in den 2., 3. Gang eingelegt wird, was gleichbedeutend mit dem Zwingen des Schalthebels ist, direkt vom 1. Gang in den 4. Gang zu schalten. Zu diesem Zeitpunkt leuchtet die Überspringen-Anzeigelampe. P0804 zeigt an, dass der Steuerkreis der Skip-Kontrollleuchte ist defekt."
