		"des": "Positive Crankcase Ventilation Filter Restriction",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "Die Funktion des positiven Kurbelgehäuseentlüftungssystems (PCV) besteht darin, das Blow-by-Gas im Kurbelgehäuse umzuleiten (am Ende des Motorarbeitsverbrennungsprozesses tritt etwas unverbranntes Gemisch aus den Kolbenringen in das Kurbelgehäuse unter Hoch Druck, die Industrie bezeichnet dieses Leck als Blow-by-Gas) Das vom Motor erzeugte Vakuum wird in den Ansaugkrümmer eingeführt, und dann gelangt das Blow-by-Gas mit Frischluft in den Zylinder und wird verbrannt, wodurch die Umweltverschmutzung verringert und verbessert wird Motoreffizienz. Der Fehlercode zeigt an, dass der Filter des Kurbelgehäuse-Zwangsbelüftungssystems verstopft ist."
