		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Schaftnadel und dem Düsenloch des Teils wird mit hoher Geschwindigkeit gesprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern der Öffnungszeitintervall (auch als Impulsbreite bezeichnet) des Einspritzventils. Wenn das Einspritzventil des 8. Zylinders Die Spannung des Steuerkreises höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt. Die Fehlerursache umfasst den Steuerkreis des Einspritzventils, den Stecker , oder die Einspritzdüse selbst; das Einspritzdüsen-Steuermodul (FICM)."
