		"des": "Air Assisted Injector Control Range/Performance",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Das luftunterstützte Einspritzventil verfeinert den Benzinnebel, indem es Hochdruckluft in die Kraftstoffeinspritzkanäle leitet, wodurch die Benzinverbrennung optimiert wird. Wenn das elektronische Steuergerät (ECU) erkennt, dass das luftunterstützte Einspritzventil diesen Fehlercode steuert wird angezeigt, wenn die Stromkreisspannung außerhalb des kalibrierten normalen Bereichs liegt. Zu den Ursachen des Fehlers gehören das Magnetventil der Lufthilfseinspritzdüse selbst oder sein Stromkreisfehler, der Sauerstoffsensorfehler oder der Fehler des Antriebsstrangsteuermoduls (PCM)."
