		"des": "Abgasrückführung A Durchfluss",
		"sys": "Emissionskontrolle",
		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von die Verbrennungskammer, wodurch die Stickoxidbelastung reduziert wird Das Abgasrückführungssystem (EGR) wird von der elektronischen Steuereinheit (ECU) während jedes Fahrzyklus überwacht Wenn die elektronische Steuereinheit (ECU) feststellt, dass die Abgasrückführung (EGR) fließt Verhältnis wird basierend auf anderen Informationen geschätzt Dieser Fehlercode wird angezeigt, wenn der Wert zu hoch oder zu niedrig ist Die Fehlerursachen umfassen EGR-Stecker, Schaltkreisfehler, Fehler des EGR-Ventils selbst, Fehler des Manifold Absolute Pressure (MAP)-Sensors, elektronisches Steuermodul (PCM oder ECM) Fehler."
