		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts des Motors Eine weitere wichtige Rolle stellt die Überwachung der Komponenten der Abgasreinigung dar. Der Motorkühlmitteltemperatursensor (ECT) übermittelt die Temperatur des Motorkühlmittels in Form eines elektrischen Signals durch das Prinzip des Thermistors an die elektronische Steuereinheit (ECU) als Grundlage für die Korrektur der Kraftstoffeinspritzung und Zündung."
