	"P0341": {
		"zzs": "Alle Autohersteller",
		"dm": "P0341",
		"des": "Schaltkreisbereich/Leistung des Nockenwellensensors A (Bank 1 oder Einzelsensor)",
		"sys": "Zündsystem",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt.Die Rolle des Nockenwellenpositionssensors (CMP) besteht darin, die Einstellung der Nockenwellenposition (die relative Position) an die zu übertragen elektronische Steuereinheit (ECU) in Form eines Spannungssignals. Dieser Fehlercode zeigt an, dass der Schaltkreis des A (Einlass/links/vorne) Nockenwellenpositionssensors (CMP) fehlerhaft ist. Die Fehlerursache umfasst die Nockenwellenposition (CMP) Sensorschaltkreis, Stecker, eigener Fehler oder Fehler des elektronischen Steuermoduls (PCM oder ECM) usw."
	},
