		"des": "B-Nockenwellenposition - Steuerzeiten zu spät (Bank 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle durch Öldruck zum Nockenwellenversteller (mechanischer Typ), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt Fehlerursachen in P0025 sind B Auslass/rechte/hintere Nockenwellensteuerung nicht eingestellt Es ist fest, die Nockenwelle klemmt mechanisch , oder das Betätigungsventil klemmt in der geöffneten Position."
