		"des": "Stromkreis Kraftstofftemperatursensor B hoch",
		"sys": "Kraftstoff oder Luft",
		"zs": "Der Kraftstofftemperatursensor überwacht die Temperatur des Kraftstoffs, der zur Kraftstoffpumpe fließt, um eine durch zu hohe Temperatur (120 Grad Celsius) verursachte Dampfsperre zu vermeiden, die zu Schäden an der Kraftstoffpumpe oder den Einspritzdüsen führen kann. Elektronische Steuereinheit (ECU ) ) überwacht kontinuierlich die Signalspannung des Kraftstofftemperatursensors. Wenn diese Spannung für einen festgelegten Zeitraum höher als der höchste kalibrierte Wert (4,5 Volt oder -43 Grad Celsius) ist, wird dieser DTC angezeigt."
