		"zs": "Kraftstofftrimmung ist, wenn die elektronische Steuereinheit (ECU) die Kraftstoffzufuhr steuert, indem sie die Öffnungszeit der Einspritzdüsen erhöht oder verringert, damit der Motor das optimale Luft-Kraftstoff-Verhältnis (14,7:1 Luft-zu-Benzin-Masse) erreicht Verhältnis) .Ein zu fettes Luft-Kraftstoff-Verhältnis bedeutet, dass die Kraftstoffzufuhr zu groß ist, und ein zu mageres Luft-Kraftstoff-Verhältnis bedeutet, dass die Kraftstoffzufuhr zu gering ist. Wenn das adaptive Kraftstoffregelungssystem die Kompensationsgrenze erreicht hat, und Das Luft-Kraftstoff-Verhältnis ist immer noch sehr fett, dieser Fehlercode Fehlerursachen sind Ansaugluftstromsensor oder Ansaugkrümmer-Absolutdrucksensor (MAP), Kraftstoffdruck zu hoch, Kraftstoffdruckreglerfehler, Kraftstoffeinspritzdüsenfehler, Sauerstoffsensorfehler, Nockenwellensteuerung Fehler, Öl zu hoch, Fehler im Verdunstungsemissionssystem, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
