		"dm": "P02CE",
		"des": "Lernen des Offsets des Kraftstoffeinspritzventils Zylinder 2 an der Mindestgrenze",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Schaftnadel und dem Düsenloch des Teils wird mit hoher Geschwindigkeit gesprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern der Öffnungszeitintervall (auch als Impulsbreite bezeichnet) des Injektors. Wenn das elektronische Steuergerät (ECU) erkennt, dass das Lernen der Einspritzkompensation des 2. Zylinders die minimale Lerngrenze erreicht hat, wird dieser Fehlercode angezeigt."
