		"sys": "Kraftstoff oder Luft",
		"zs": "Kraftstofftrimmung ist, wenn die elektronische Steuereinheit (ECU) die Kraftstoffzufuhr steuert, indem sie die Öffnungszeit der Einspritzdüsen erhöht oder verringert, damit der Motor das optimale Luft-Kraftstoff-Verhältnis (14,7:1 Luft-zu-Benzin-Masse) erreicht Verhältnis) Das Luft-Kraftstoff-Verhältnis ist zu fett für zu viel Kraftstoffzufuhr und zu mager für zu wenig Kraftstoffzufuhr. Dieser DTC wird angezeigt, wenn die Kraftstofftrimmung die maximale Grenze erreicht und länger als eine bestimmte Zeit dort bleibt."
