		"sys": "Kraftstoff oder Luft",
		"zs": "Das Dieselmotor-Ansaugluftstrom-Steuersystem bildet einen effektiven Ansaugwirbel, indem es automatisch den Öffnungswinkel der Drosselklappe steuert und mit dem tangentialen Luftkanal oder dem spiralförmigen Luftkanal zusammenarbeitet und gleichzeitig automatisch die Stärke steuert des Ansaugdralls steuern, die Verbrennung des Motors effektiv verbessern und dadurch die Leistungskennzahlen wie Motorleistung und Wirtschaftlichkeit optimieren."
