		"zs": "Das Injector Control Module (FICM) ist verantwortlich für die Steuerung des Injektor-Magnetventils basierend auf den Kraftstoff- und Zeitinformationen des Electronic Control Module (ECU). Die Electronic Control Unit (ECU) steuert das Injektor-Öffnungsintervall (Auch Impulsbreite genannt) zur Steuerung der eingespritzten Kraftstoffmenge. P0611 weist auf eine Fehlfunktion des Injektorsteuermoduls (FICM) hin."
