		"zs": "Der Getriebeöltemperatursensor (TFT) überträgt die Getriebeöltemperatur in Form eines elektrischen Signals nach dem Prinzip des Thermistors an das elektronische Steuergerät (ECU). zu hoch, schaltet das Getriebesteuergerät (TCU) herunter und verlangsamt. Bei einigen Neuwagen verwendet das TCU dieses Temperatursignal, um die Viskosität des Getriebeöls zu bestimmen und dadurch den Leitungsdruck und den Druck des Magnetventils anzupassen. Wenn das elektronische Steuergerät (ECU ) erkennt die Signalspannung des Getriebeöltemperatursensors (TFT) Plötzliche Änderungen, dieser Fehlercode wird angezeigt.Die Gründe für den Fehler umfassen den Fehler des TFT-Sensors selbst oder seines Stromkreises oder Steckers, Fehler des elektronischen Steuermoduls (PCM oder ECM), usw."
