		"zs": "Die Rolle des Ansauglufttemperatursensors (IAT) besteht darin, die Ansauglufttemperatur des Motors in Form eines Spannungssignals an die elektronische Steuereinheit (ECU) zu senden, um eine Referenz für die Korrektur der Kraftstoffeinspritzung bereitzustellen. Wenn das elektronische Steuergerät (ECU) feststellt, dass die Signalspannung des Ansauglufttemperatursensors (IAT) niedriger ist als der Mindestwert des Selbsttests (0,2 Volt oder 121 Grad Celsius), wird dieser Fehlercode angezeigt."
