		"dm": "P068B",
		"des": "ECM/PCM-Leistungsrelais abgefallen - zu spät",
		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts des Motors Eine weitere wichtige Rolle stellt die Überwachung der Komponenten der Abgasreinigung dar. Die Funktion des Relais des Motorsteuergeräts besteht darin, die Stromversorgung des Motorsteuergeräts nach der Zündung aufrechtzuerhalten Schalter ausgeschaltet ist, bis das Motorsteuergerät abgeschlossen ist. Schließen Sie den Vorgang."
