		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Die elektronische Steuereinheit (ECU) hat einen Fehler im 5-V-Referenzspannungskreis D erkannt. Die Fehlerursache umfasst einen Kurzschluss oder Kurzschluss vom 5-V-Referenzspannungskreis zu einem bestimmten Sensor, einen Kurzschluss oder eine Unterbrechung Stromkreis in einem oder mehreren Sensoren, ECU usw."
