		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher Katalysator), Der zweite Sensor ist immer der nachgeschaltete Sauerstoffsensor (nach dem Katalysator). Dieser DTC wird angezeigt, wenn das elektronische Steuergerät (ECU) feststellt, dass der Strom zum Heizungssteuerkreis für den beheizten Sauerstoffsensor zu niedrig ist oder zu hoch."
