		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der 2. Sensor bezieht sich immer auf die nachgeschaltete Lambdasonde (nach dem Katalysator). Das elektronische Steuergerät (ECU) überwacht ständig die beheizte Lambdasonde und hat festgestellt, dass die Lambdasonde funktioniert. Wenn der Signalwert von Bleibt der beheizte Sauerstoffsensor auf dem Standardwert, wird die ECU (ECU) das oszillierende Luft/Kraftstoff-Verhältnis anweisen, um zu versuchen, eine Änderung des Signalwerts zu erkennen. Wenn die ECU die Änderung des Sensorsignals zu diesem Zeitpunkt immer noch nicht erkennen kann , der Fehlercode wird angezeigt."
