	"P00A3": {
		"zzs": "Alle Autohersteller",
		"dm": "P00A3",
		"des": "Schaltkreis Temperatursensor Ladeluftkühler hoch (Bank 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Turbolader nutzt das Trägheitsmoment des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, die wiederum das koaxiale Laufrad antreibt, um die Ansaugluft unter Druck zu setzen und so die Leistung des Fahrzeugs zu steigern. Der Ladeluftkühler ( auch Ladeluftkühler genannt) ) wird verwendet, um die aufgeladene Luft vom Kompressor zu kühlen. Nachdem die Luft den Kompressor passiert hat, steigt der Druck und die Temperatur steigt. Die Temperatur der aufgeladenen Luft kann durch den Kompressor-Luftkühler reduziert werden, wodurch die Luft erhöht wird Dichte und Erhöhung der Ladeeffizienz, um die Motorleistung zu erhöhen und Emissionen zu reduzieren. Ursachen für diesen Fehlercode sind der Temperatursensor des Ladeluftkühlers, sein Schaltkreis oder Verbindungsprobleme."
	},
