		"sys": "Hybridsystem",
		"zs": "Das Batteriesteuermodul steuert den Batterielüfter basierend auf dem Signal des Batterietemperatursensors ein/aus. Wenn das Batteriesteuermodul feststellt, dass die Spannung des Signalstromkreises des Batterietemperatursensors außerhalb des normalen Bereichs liegt, wird dieser Fehler angezeigt Code erscheint."
