		"des": "Cruise Control Input Circuit",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "CRUISE CONTROL SYSTEM erlaubt dem Fahrer, die Fahrzeuggeschwindigkeit automatisch beizubehalten, ohne das Gaspedal zu betätigen."
