		"dm": "P0A9D",
		"des": "Hybrid-Batterietemperatursensor A Stromkreis niedrig",
		"sys": "Hybridsystem",
		"zs": "Das Batteriesteuermodul steuert den Batterielüfter basierend auf dem Signal des Batterietemperatursensors ein/aus. Wenn das Batteriesteuermodul feststellt, dass die Signalstromkreisspannung des Batterietemperatursensors niedriger als der kalibrierte Mindestwert ist, wird dieser Fehler angezeigt Code erscheint."
