		"dm": "P0098",
		"des": "Stromkreis Ansauglufttemperatursensor 2 hoch (Bank 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Rolle des Ansauglufttemperatursensors (IAT) besteht darin, die Ansauglufttemperatur des Motors in Form eines Spannungssignals an die elektronische Steuereinheit (ECU) zu senden, um eine Referenz für die Korrektur der Kraftstoffeinspritzung bereitzustellen. Wenn das elektronische Steuergerät (ECU) erkennt, dass die Signalspannung des Ansauglufttemperatursensors (IAT) höher ist als der Maximalwert des Selbsttests (4,6 Volt oder -50 Grad Celsius), wird dieser Fehlercode angezeigt."
