		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von Verbrennungsraum, wodurch die Verschmutzung durch Stickoxide reduziert wird. Dieser DTC wird angezeigt, wenn das elektronische Steuergerät (ECU) erkennt, dass die Signalspannung des Temperatursensors des Abgasrückführungsventils (AGR) außerhalb des kalibrierten Normalbereichs liegt."
