		"sys": "Zündsystem",
		"zs": "Der Klopfsensor ist dafür verantwortlich, Vibrationen zu erkennen, wenn sich die Motordrehzahl ändert. Der Klopfsensor drückt diese Vibration dann in Form einer Spannung aus. Bei Bedarf verzögert das elektronische Steuergerät (ECU) die Zündung usw. um ein Klopfen zu vermeiden. Wenn sich diese Spannung plötzlich ändert, wird dieser DTC angezeigt."
