		"dm": "P0802",
		"des": "Getriebesteuerungssystem MIL-Anforderung Stromkreis/Öffnen",
		"sys": "Getriebe",
		"zs": "Das Transmission Control Module (TCM oder TCU) hilft dem Getriebe bei der Entscheidung, wann und wie der Gang gewechselt werden soll, indem Informationen von verschiedenen Sensoren und dem Motorsteuermodul gesammelt werden, um die Leistung des Fahrzeugs zu verbessern, reibungslos zu schalten und Kraftstoff zu sparen. Die Fehlfunktion Indicator Light (MIL), auch Check Engine Light genannt, leuchtet ein gelbes oder rotes Motorsymbol auf der Instrumententafel auf, wenn das Steuermodul eine Fehlfunktion erkennt."
