		"des": "Schaltkreis des Katalysatortemperatursensors (Bank 1, Sensor 2)",
		"sys": "Emissionskontrolle",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln vor dem Schalldämpfer im Auspuffrohr. Dieser Fehlercode weist auf eine Fehlfunktion im Stromkreis des Katalysatortemperatursensors hin. Zu den Ursachen gehören der Katalysatortemperatursensor, sein Stromkreis, Anschlüsse oder die elektronische Steuereinheit (ECU)."
