	"P0353": {
		"zzs": "Alle Autohersteller",
		"dm": "P0353",
		"des": "Zündspule C Primär-/Sekundärkreis",
		"sys": "Zündsystem",
		"zs": "Die Rolle der Zündspule besteht darin, die 12-Volt-Spannung der Autobatterie in Tausende oder sogar Zehntausende von Volt umzuwandeln, die für die Zündkerzenzündung erforderlich sind. Es gibt zwei Spulensätze in der Zündspule, die Primärspule und Sekundärspule. Die Primärspule hat dickeren Lackdraht mit weniger Windungen; die Sekundärspule verwendet dünneren Lackdraht, der relativ mehr Windungen hat. Wenn die Primärspule eingeschaltet wird, wird um sie herum ein starkes Magnetfeld erzeugt Strom steigt und der Eisenkern speichert Magnetfeldenergie; wenn das Schaltgerät den Primärspulenkreis trennt, fällt das Magnetfeld der Primärspule schnell ab und eine hohe Spannung wird in der Sekundärspule induziert. Die elektronische Steuereinheit (ECU) überwacht kontinuierlich jeden Hauptstromkreis der Zündung. Wenn das ECU kein gültiges IDM-Impulssignal (Induction Diagnostic Monitor) vom Zündmodul (in das ECU integriert) empfängt, wird der Fehlercode angezeigt. Die Ursachen des Fehlers umfassen Zündstart/-lauf Stromkreis, Zündspulenstromkreis, Fehler der Zündspule selbst, Fehler des elektronischen Steuermoduls (PCM oder ECM) usw."
	},
