	"P0492": {
		"zzs": "Alle Autohersteller",
		"dm": "P0492",
		"des": "Sekundärlufteinspritzsystem unzureichender Durchfluss (Bank 2)",
		"sys": "Emissionskontrolle",
		"zs": "Wenn der Motor gerade gestartet wird, oxidiert das Sekundärluft-Einspritzsystem die erzeugten Kohlenwasserstoffe, Kohlenmonoxid und andere schädliche Gase, indem es Luft in den Abgaskrümmer drückt. Dieser Vorgang beschleunigt auch die Erwärmung des Katalysators. Vorgang. Wenn die elektronische Steuereinheit (ECU) erkennt, dass der Durchfluss des Sekundärluft-Einspritzsystems unzureichend ist, wird dieser Fehlercode angezeigt.Die Ursachen des Fehlers umfassen eine Blockierung des Luftpumpenausgangs, ein Leck oder eine Blockierung des AIR-Bypass-Magnetventils, das festsitzt AIR-Bypass-Magnetventil, Ventilausfall, Leck in der Leitung der elektronischen Lufteinspritzpumpe, Ausfall der elektronischen Lufteinspritzpumpe, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
	},
