		"sys": "Hybridsystem",
		"zs": "Die Aufgabe des Wechselrichters besteht darin, Gleichstrom in Wechselstrom umzuwandeln. Das elektronische Steuergerät des Hybridfahrzeugs (HV-ECU) ist für die Überwachung des Stromkreises des Spannungssensors des Antriebsmotor-Wechselrichters verantwortlich. Wenn das HV-ECU einen Fehler im Wechselrichter-Spannungssensor, dieser Fehlercode wird angezeigt."
