		"des": "Stromsensorkreis Phase V des Antriebsmotors A",
		"sys": "Hybridsystem",
		"zs": "Die elektronische Steuereinheit des Hybridfahrzeugs (HV ECU) ist für die Überwachung des Wechselrichterstromsensors des Antriebsmotors verantwortlich. Dieser DTC wird angezeigt, wenn die HV ECU einen Fehler erkennt."
