		"dm": "P0C6A",
		"des": "Generatorpositionssensor Kreis B Reichweite/Leistung",
		"sys": "Hybridsystem",
		"zs": "Die Fehlerursache umfasst den Stromkreis des Positionssensors des Generators, den Stecker oder den Sensor selbst; den Generator des Hybridfahrzeugs; die elektronische Steuereinheit des Hybridfahrzeugs (HV ECU)."
