	"P0C3E": {
		"zzs": "Alle Autohersteller",
		"dm": "P0C3E",
		"des": "DC/DC-Wandler Temperatursensor B Bereich/Leistung",
		"sys": "Hybridsystem",
		"zs": "Der DC/DC-Wandler wandelt die DC-Hochspannung (200-400 Volt) der HV-Batterie in 12 Volt um, die die Hilfsbatterie laden und das Zubehör im Fahrzeug mit Strom versorgen können."
	},
	"P0506": {
		"zzs": "Alle Autohersteller",
		"dm": "P0506",
		"des": "Drehzahl des Leerlaufluftregelungssystems niedriger als erwartet",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "Das Idle Air Control (IAC)-Ventil hat ein bewegliches Nadelventil, das von einem sich präzise bewegenden Schrittmotor gesteuert wird. Bei geschlossener Drosselklappe steuert das IAC-Ventil die Leerlaufdrehzahl, indem es den Luftstrom in der Bypassleitung ändert Anpassung an die Leerlaufdrehzahl unter verschiedenen Bedingungen. Wenn das elektronische Steuergerät (ECU) feststellt, dass die Motordrehzahl niedriger als der eingestellte Wert ist, wird dieser Fehlercode angezeigt Magnetventilfehler, Fehler des elektronischen Steuermoduls (PCM oder ECM), Fehler des Fahrzeuggeschwindigkeitssensors usw."
	},
	"P0383": {
		"zzs": "Alle Autohersteller",
		"dm": "P0383",
		"des": "Steuerstromkreis des Glühkerzensteuergeräts niedrig",
		"sys": "Zündsystem",
		"zs": "Die Funktion der Glühkerze besteht darin, das komprimierte Gas im Brennraum des Dieselmotors durch die Heizspule zu erwärmen, wodurch der Dieselmotor im kalten Zustand leicht gestartet werden kann. Das Glühkerzensteuergerät kann automatisieren des Glühkerzen-Vorwärm- und Einschaltvorgangs. Wenn die elektronische Steuerungseinheit (ECU) festgestellt hat, dass die Schaltkreisspannung des Glühkerzen-Steuermoduls unter dem kalibrierten Mindestwert liegt, wird dieser Fehlercode angezeigt."
	},
	"P0242": {
		"zzs": "Alle Autohersteller",
		"dm": "P0242",
		"des": "Turbolader/Kompressor Ladedrucksensor B Stromkreis hoch",
		"sys": "Kraftstoff oder Luft",
		"zs": "Der Turbolader nutzt das Trägheitsmoment des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, die wiederum das koaxiale Laufrad antreibt, um die Ansaugluft unter Druck zu setzen und dadurch die Leistung des Autos zu erhöhen. Der Kompressor ist ein Kompressor Wird verwendet, um die Leistung des Verbrennungsmotors zu steigern Luftkompressor für Ansaugluft Mehr Ansaugluft versorgt den Motor mit mehr Sauerstoff, wodurch das Steuermodul mehr Kraftstoff liefern kann, was die Leistungsabgabe erhöht Boost-Sensor, auch Ladedrucksensor genannt (BPS), Seine Funktion besteht darin, den Ladedruck als elektrisches Signal an die elektronische Steuereinheit (ECU) zu übertragen. Wenn die Signalspannung des Ladedrucksensors höher als 5,0 Volt ist, wird dieser Fehlercode angezeigt."
	},
