		"des": "Hybrid Battery Pack Cooling Fan 1 Control Circuit High",
		"sys": "Hybridsystem",
		"zs": "Die Lüftermotorsteuerung ist für die Regelung der Spannung des Kühlgebläses des Hybridbatteriepakets verantwortlich. Dieser Fehlercode wird angezeigt, wenn die Steuerkreisspannung des Kühlgebläses 1 höher als der kalibrierte Maximalwert ist."
