	"P0042": {
		"zzs": "Alle Autohersteller",
		"dm": "P0042",
		"des": "HO2S-Heizungssteuerkreis (Bank 1, Sensor 3)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der 2. Sensor bezieht sich immer auf den stromabwärtigen Sauerstoffsensor (nach dem Katalysator). Der Sauerstoffsensor funktioniert nicht innerhalb der eingestellten Zeit. Wenn die erforderliche Temperatur erreicht ist oder die ECU die eingestellte Temperatur nicht halten kann, wird dieser Fehlercode angezeigt."
	},
