		"dm": "P0452",
		"des": "Drucksensor/Schalter des Verdunstungsemissionssystems niedrig",
		"sys": "Emissionskontrolle",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Vorratstank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Der Fehlercode wird angezeigt, wenn das elektronische Steuergerät (ECU) feststellt, dass das Eingangssignal vom Tankdrucksensor des Verdunstungsemissionskontrollsystems zum ECU unter dem kalibrierten Mindestwert (0,22 Volt) liegt."
