		"zs": "Für ein Hochleistungsauto, um die Kraftstoffeffizienz des Autos zu verbessern und die Emissionen zu reduzieren, wenn die Bedingungen erfüllt sind (niedrige Geschwindigkeit, kleines Gaspedal, das Auto ist aufgewärmt usw.), das Überspringen Magnetventil verhindert, dass der Gang hängen bleibt. Das Einlegen des 2. oder 3. Gangs entspricht dem direkten Drücken des Schalthebels vom 1. Gang in den 4. Gang. Dieser Fehlercode zeigt an, dass die Spannung des Steuerkreises des Magnetventils zum Überspringen niedriger als der kalibrierte Mindestwert ist ."
