		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der 2. Sensor bezieht sich immer auf den nachgeschalteten Sauerstoffsensor (nach dem Katalysator).Dieser Fehlercode wird angezeigt, wenn die Spannung des Signals des beheizten Sauerstoffsensors für eine eingestellte Zeitdauer höher als 1,5 Volt ist. Die Ursache des Fehlers umfasst das Signal der Lambdasonde. Der Stromkreis ist mit Plus kurzgeschlossen, die Lambdasonde selbst ist defekt, das elektronische Steuermodul (PCM oder ECM) ist defekt usw."
