		"des": "Zylinder 9 Einspritzkreis niedrig",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet und der Kraftstoff fließt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Düsenloch wird mit hoher Geschwindigkeit versprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern des Öffnungszeitintervalls ( auch Impulsbreite genannt) des Einspritzventils. Wenn das Einspritzventil des 9. Zylinders Dieser DTC erscheint, wenn die Spannung des Steuerkreises unter dem kalibrierten Mindestwert liegt. Zu den Ursachen gehören der Steuerkreis des Einspritzventils, der Stecker oder das Einspritzventil selbst; das Einspritzventil-Steuermodul (FICM)."
