		"zs": "Das Powertrain Control Module (PCM) verwendet einen Klopfsensor, um Vibrationen zu erkennen, wenn sich die Motordrehzahl ändert. Der Klopfsensor drückt diese Vibration dann als Spannung aus. Das elektronische Steuergerät (ECU) reagiert bei Bedarf. Vermeiden Sie es, vorbeizuklopfen Verzögerung der Zündung usw. Dieser Fehlercode weist auf eine Fehlfunktion im internen Steuermodul hin."
