		"des": "Positionssensor des Abgasdruckregelventils/Schaltkreisbereich/Leistung",
		"sys": "Emissionskontrolle",
		"zs": "Das Abgasdruckregelventil ist ein Ventil mit variabler Position. Seine Hauptfunktion besteht darin, den Motor bei extrem niedrigen Außentemperaturen (<5 Grad Celsius) durch Ändern des Abgasdrucks (gesteigerte Motorlast) schnell aufzuheizen. .. Wenn das elektronische Steuergerät (ECU) einen Fehler in der Signalspannung des Positionssensors des Abgasdruckregelventils erkennt, wird dieser Fehlercode angezeigt."
