		"zs": "Das Dieselmotor-Ansaugluftstrom-Steuersystem bildet einen effektiven Ansaugwirbel, indem es automatisch den Öffnungswinkel der Drosselklappe steuert und mit dem tangentialen Luftkanal oder dem spiralförmigen Luftkanal zusammenarbeitet und gleichzeitig automatisch die Stärke steuert des Einlassdralls. Steuern, verbessern effektiv die Verbrennung des Motors und optimieren dadurch die Leistungsindikatoren für Motorleistung, Wirtschaftlichkeit usw. ECM). "
