		"des": "Kurbelwellensensor B Stromkreis niedrig",
		"sys": "Zündsystem",
		"zs": "Die Funktion der Kurbelwelle besteht darin, die Auf- und Abwärtsbewegung des Kolbens in eine Drehbewegung umzuwandeln. Der Kurbelwellenpositionssensor (CKP) (auch oberer Totpunktsensor genannt) wird verwendet, um den oberen Totpunkt zu erfassen (TDC)-Signal und das Kurbelwellenwinkelsignal und das Motordrehzahlsignal und geben Sie es in den Computer ein, damit der Computer den besten Zündzeitpunktbefehl entsprechend der Zündfolge der Zylinder ausgeben kann. erkennt, dass die Spannung des Schaltkreises des Kurbelwellensensors B niedriger als der Mindestwert der Kalibrierung ist, wird der Fehlercode angezeigt."
