		"zs": "Die Funktion des Kurbelgehäuse-Drucksensors besteht darin, den Druck im Kurbelgehäuse in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden, um den Betriebszustand des Zwangsentlüftungssystems des Kurbelgehäuses zu erkennen. Wenn Die ECU erkennt den Kurbelgehäusedruck. Plötzliche Änderung der Spannung des Sensorsignalkreises, dieser Fehlercode wird angezeigt."
