		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung. Dieser DTC zeigt an, dass die Stromkreisspannung des Drosselpedalpositionssensors C für einen festgelegten Zeitraum unter dem kalibrierten Mindestwert (0,2 Volt) geblieben ist."
