		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung verändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Öldruck zum Nockenwellenversteller (mechanisch) wird verwendet, um den Winkel der Nockenwelle einzustellen, um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt."
