		"sys": "Kraftstoff oder Luft",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenaktuator zur Steuerung der Drosselklappe Referenzbasis für Ventilöffnung Dieser Fehlercode zeigt an, dass die Stromkreisspannung des Gaspedalpositionssensors B für einen festgelegten Zeitraum kontinuierlich unter dem kalibrierten Mindestwert (0,17 Volt) liegt Fehlerursachen umfassen Sensorschnittstellenfehler, Kurzschluss zu Masse, Der Sensor selbst ist defekt, das elektronische Steuermodul (PCM oder ECM) ist defekt usw."
