	"P0342": {
		"zzs": "Alle Autohersteller",
		"dm": "P0342",
		"des": "Schaltkreis Nockenwellensensor A niedrig (Bank 1 oder Einzelsensor)",
		"sys": "Zündsystem",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt.Die Rolle des Nockenwellenpositionssensors (CMP) besteht darin, die Einstellung der Nockenwellenposition (die relative Position) an die zu übertragen elektronisches Steuergerät (ECU) in Form eines Spannungssignals. Dieser Fehlercode zeigt an, dass die Signalspannung des Nockenwellensensors A (Einlass/links/vorne) (CMP) niedriger als der kalibrierte Mindestwert ist der Schaltkreis des Nockenwellensensors (CMP), der Stecker selbst defekt oder der Fehler des elektronischen Steuermoduls (PCM oder ECM) usw. "
	},
