		"dm": "P0BC5",
		"des": "Hybrid-Batterietemperatursensor E Schaltkreis hoch",
		"sys": "Hybridsystem",
		"zs": "Das Batteriesteuermodul steuert den Batterielüfter basierend auf dem Signal des Batterietemperatursensors. Dieser Fehlercode wird angezeigt, wenn das Batteriesteuermodul feststellt, dass die Signalstromkreisspannung des Batterietemperatursensors höher als die kalibrierte ist Maximalwert."
