		"sys": "Getriebe",
		"zs": "Die Funktion des Schalters Parkgang/Neutralstellung besteht darin, die Informationen des Automatikgetriebes im Parkgang/Neutralgang oder in anderen Gängen als Entscheidung für den Leerlauf des Motors an das elektronische Steuergerät (ECU) zu senden oder erhöhen Sie die Lastreferenzbasis. Dieser Schalter wird auch in der Starterrelaisschaltung verwendet, um zu verhindern, dass das Auto in anderen Gängen als Park/Neutral startet."
