	"P0604": {
		"zzs": "Alle Autohersteller",
		"dm": "P0604",
		"des": "Interner Steuermodul-Random-Access-Memory (RAM)-Fehler",
		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist um die optimale Kraftstoffeinspritzmenge und den Zündzeitpunkt des Motors zu steuern. Eine weitere wichtige Rolle ist die Überwachung der Komponenten der Abgasemissionssteuerung. Die Fehlerursachen umfassen Batterieelektrodenkorrosion (verursacht Spannungsinstabilität), Schaltkreisfehler des elektronischen Steuermoduls, Neuprogrammierungsfehler , Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
	},
