	"P0251": {
		"zzs": "Alle Autohersteller",
		"dm": "P0251",
		"des": "Einspritzpumpen-Kraftstoffdosiersteuerung A (Nocken/Rotor/Einspritzdüse)",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Ursache des Ausfalls umfasst den Kraftstoffregelaktuator (FCA), seinen Schaltkreis, die Kraftstoffeinspritzpumpe oder das elektronische Steuermodul (ECU) usw. Der Kraftstoffregelaktuator (FCA) befindet sich im Allgemeinen auf dem Rückseite der Kraftstoffeinspritzpumpe, es ist ein elektrisches Magnetventil. Die ECU steuert die Kraftstoffmenge, die zur Kraftstoffeinspritzpumpe fließt, indem sie den FCA ein- und ausschaltet."
	},
