		"sys": "Emissionskontrolle",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Speichertank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Das elektronische Steuergerät (ECU) erkennt, dass der Steuerstromkreis des Spülmagnetventils des Verdunstungsemissionssystems einen offenen Stromkreis hat, dann wird dieser Fehlercode angezeigt an Masse, elektromagnetisches EVAP-Ventil Das Ventil selbst ist defekt, der EVAP-Kanister ist undicht, das elektronische Steuermodul (PCM oder ECM) ist defekt usw."
