		"dm": "P0289",
		"des": "Zylinder 10 Einspritzkreis hoch",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Düsenloch wird mit hoher Geschwindigkeit versprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern des Öffnungszeitintervalls (auch Impulsbreite genannt) der Einspritzdüse Wenn die Spannung der Steuerschaltung des 10. Zylinders höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt Die Fehlerursache umfasst die Steuerschaltung der Einspritzdüse, den Stecker oder die Injektor selbst; das Injektorsteuermodul (FICM)."
