		"zs": "Zylinderfehlzündung bezieht sich auf das Phänomen, dass das Gemisch aus verschiedenen Gründen während des Motorbetriebs nicht richtig im Zylinder verbrannt werden kann. Wenn das elektronische Steuergerät (ECU) eine Fehlzündung erkennt, kann dies zu Schäden am Katalysator führen Die Fehleranzeige blinkt und der Motor sollte sofort abgestellt werden Dieser Fehlercode zeigt an, dass das elektronische Steuergerät (ECU) eine Fehlzündung in diesem Zylinder 12 erkannt hat Krümmer oder AGR, PCV-Luftlecks, mechanischer Zylinderausfall usw."
