		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle durch Öldruck zum Nockenwellenversteller (mechanischer Typ), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt. Die Ausfallursachen des P000A umfassen das Einlass-/linke/vordere Nockenwellenverstellventil (Ölsteuerventil) Ventil) , seine Schaltkreise, Anschlüsse, verschmutztes Öl oder ECU."
