		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeöl-Steuerventils, um das Ausrücken und Einrücken zum Schalten zu steuern. Eine genaue Steuerung des Getriebeöldrucks ist wichtig für sanftes Schalten. Der Getriebeöldruck (TFP)-Sensor sendet den Getriebeöldruck in Form eines elektrischen Signals an das Getriebesteuergerät (TCU), und das Getriebeöldruck-Steuermagnetventil ist für die Steuerung des Getriebeöldrucks verantwortlich."
