	"P02AD": {
		"zzs": "Alle Autohersteller",
		"dm": "P02AD",
		"des": "Zylinder 5 - Einspritzventil undicht",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Düsenloch wird mit hoher Geschwindigkeit ausgestoßen, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern des Öffnungszeitintervalls ( auch Impulsbreite genannt) der Einspritzdüse. Dieser Fehlercode zeigt an, dass die Einspritzdüse des fünften Zylinders undicht ist."
	},
	"P0239": {
		"zzs": "Alle Autohersteller",
		"dm": "P0239",
		"des": "Turbolader/Kompressor Ladedrucksensor B Stromkreis",
		"sys": "Kraftstoff oder Luft",
		"zs": "Der Turbolader nutzt das Trägheitsmoment des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, die wiederum das koaxiale Laufrad antreibt, um die Ansaugluft unter Druck zu setzen und dadurch die Leistung des Autos zu erhöhen. Der Kompressor ist ein Kompressor Wird verwendet, um die Leistung des Verbrennungsmotors zu steigern Luftkompressor für Ansaugluft Mehr Ansaugluft versorgt den Motor mit mehr Sauerstoff, wodurch das Steuermodul mehr Kraftstoff liefern kann, was die Leistungsabgabe erhöht Boost-Sensor, auch Ladedrucksensor genannt (BPS), Seine Funktion besteht darin, den Ladedruck in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen. Wenn die ECU erkennt, dass das Signal des Ladedrucksensors (BPS) außerhalb des kalibrierten Normalbereichs liegt, wird dieser Fehlercode angezeigt wird auftauchen."
	},
	"P0068": {
		"zzs": "Alle Autohersteller",
		"dm": "P0068",
		"des": "MAP/MAF - Drosselklappenpositionskorrelation",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Ansaugkrümmer-Absolutdrucksensor (MAP) misst den Druck (Unterdruck) im Ansaugkrümmer. Das Powertrain Control Module (PCM) passt dann die Differenz zwischen Ansaugkrümmerdruck und atmosphärischem Druck an. Die Differenz (lineare Beziehung zur Motorlast ) wird als Grundlage für die Bestimmung der grundlegenden Kraftstoffeinspritzmenge des Einspritzventils verwendet, um dem Motor zu helfen, das beste Luft-Kraftstoff-Verhältnis unter verschiedenen Lasten zu erreichen Das Signal wird als eines der grundlegenden Signale zur Bestimmung der Kraftstoffeinspritzmenge an die elektronische Steuereinheit (ECU) gesendet. Die Funktion des Drosselklappenpositionssensors (TP) besteht darin, den Drosselklappenöffnungsgrad an die elektronische Steuereinheit (ECU) zu senden ) in Form eines elektrischen Signals , als einer der grundlegenden Parameter für die Steuerung der Motorkraftstoffeinspritzung Wenn das ECU feststellt, dass die vom Krümmerabsolutdrucksensor (MAP) / Luftstromsensor (MAF) berechnete Last und die Drosselklappenstellung ( TP)-Sensor zu unterschiedlich ist, wird der Fehlercode angezeigt."
	},
	"P0B4D": {
		"zzs": "Alle Autohersteller",
		"dm": "P0B4D",
		"des": "Hybrid Battery Voltage Sense D Circuit High",
		"sys": "Hybridsystem",
		"zs": "Die Funktion der Spannungsüberwachungsschaltung der Hybridbatterie besteht darin, die Spannung des Batterieblocks an das Steuermodul zu übertragen, um das Laden und Entladen des Batterieblocks sowie mögliche Kurzschluss- und Unterbrechungsbedingungen zu überwachen ."
	},
	"P0789": {
		"zzs": "Alle Autohersteller",
		"dm": "P0789",
		"des": "Schaltzeitpunkt-Magnetventil A intermittierend",
		"sys": "Getriebe",
		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeölsteuerventils, um das Aus- und Einrücken zum Schalten zu steuern. Zu den Ursachen dieses Fehlercodes gehört ein zu hoher Getriebeölstand. Niedrig , Getriebeöl ist zu verschmutzt, mechanischer Defekt des Schaltmagnetventils, Stromkreis, Stecker oder Defekt des Getriebesteuermoduls (TCM) usw."
	},
