		"dm": "P0447",
		"des": "Entlüftungssteuerkreis des Verdunstungsemissionssystems offen",
		"sys": "Emissionskontrolle",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Vorratstank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Fehlercode erscheint, wenn die elektronische Steuereinheit (ECU) eine Unterbrechung im Steuerstromkreis der Belüftung des Verdunstungsemissionssystems erkannt hat."
