		"sys": "Zündsystem",
		"zs": "Der optische Sensor liefert ein hochauflösendes Signal an das Powertrain Control Module (PCM), indem er Impulse auf einer Sensorscheibe zählt, die sich in der Einspritzpumpe befindet. Dieses Signal ist eine der wichtigen Referenzen für das PCM, um den Kraftstoff zu steuern und zu steuern Timing. Ursachen für diesen Fehlercode sind der optische Sensor, seine Schaltung, Anschlüsse oder PCM."
