		"dm": "P0663",
		"des": "Steuerstromkreis Ansaugkrümmer-Tuningventil/offen (Bank 2)",
		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Bei optimaler Länge des Ansaugkrümmerkanals (Läufer) hilft die durch das Schließen der Ventile erzeugte Druckwelle, das Öl-Luft-Gemisch in den Motor zu leiten. Das Problem ist, dass die optimale Länge des Ansaugkrümmerkanals für unterschiedliche Motordrehzahlen ist auch anders Die Funktion des Saugrohr-Tuning-Ventils (MTV) besteht darin, die Ansaugluft in Abhängigkeit von der Motordrehzahl in unterschiedlich lange Ansaugkrümmerkanäle zu leiten, um das Drehmoment des Motors bei unterschiedlichen Drehzahlen zu optimieren . Wenn das elektronische Steuergerät (ECU) während der Inspektion automatisch erkennt, dass die Spannung des Steuerkreises des Einlasskrümmer-Abstimmventils den normalen Wert der Kalibrierung überschreitet, wird dieser Fehlercode angezeigt."
