		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der 2. Sensor bezieht sich immer auf die nachgeschaltete Lambdasonde (nach dem Katalysator).Die elektronische Steuereinheit (ECU) überwacht kontinuierlich die beheizte Lambdasondenheizung, um sicherzustellen, dass kein offener Stromkreis, Kurzschluss oder übermäßiger Strom vorhanden ist Stromaufnahme. Wenn die Stromaufnahme die kalibrierten Grenzwerte überschreitet oder ein offener Stromkreis oder ein Kurzschluss erkannt wird, wird der Fehlercode angezeigt. Zu den Fehlerursachen gehören der Heizkreis des Sauerstoffsensors, ein Steckerausfall, der Sauerstoffsensor selbst, das elektronische Steuermodul (PCM oder ECM) Fehler usw."
