		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Einspritzloch des Teils wird mit hoher Geschwindigkeit gesprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern der Öffnung Zeitintervall (auch Impulsbreite genannt) der Einspritzdüse. Dieser Fehlercode zeigt an, dass die Einspritzdüse des dritten Zylinders undicht ist."
