		"des": "Leerlaufregelkreis",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "Das Idle Air Control (IAC)-Ventil hat ein bewegliches Nadelventil, das von einem sich präzise bewegenden Schrittmotor gesteuert wird. Bei geschlossener Drosselklappe steuert das IAC-Ventil die Leerlaufdrehzahl, indem es den Luftstrom in der Bypassleitung ändert Anpassung an die Leerlaufdrehzahl unter verschiedenen Bedingungen Wenn das elektronische Steuergerät (ECU) feststellt, dass die Spannung des Steuerkreises des Leerlaufluftsteuerventils (IAC) außerhalb des normalen Bereichs liegt, wird dieser Fehlercode angezeigt der IAC-Steuerkreis, Verbindungsfehler, IAC-Stellgliedfehler oder Fehler des elektronischen Steuermoduls (PCM oder ECM)."
