		"des": "Bereich/Leistung des Hochschalt-/Schaltmagnetventil-Steuerkreises",
		"sys": "Getriebe",
		"zs": "Für einige Hochleistungsautos, um die Kraftstoffeffizienz des Autos zu verbessern und die Emissionen zu reduzieren, wenn die Bedingungen erfüllt sind (niedrige Geschwindigkeit, kleines Gaspedal, das Auto wurde aufgewärmt usw.). Magnetventil zum Überspringen verhindert, dass der Gang in den 2., 3. Gang eingelegt wird, was gleichbedeutend mit dem direkten Umschalten des Schalthebels vom 1. in den 4. Gang ist. Dieser Fehlercode weist auf einen Fehler im Steuerkreis des Magnetventils zum Überspringen hin."
