		"zs": "Die Funktion der Glühkerze besteht darin, das komprimierte Gas im Brennraum des Dieselmotors durch die Heizspule zu erwärmen, wodurch der Dieselmotor im kalten Zustand leicht gestartet werden kann. Das Glühkerzensteuergerät kann automatisieren des Glühkerzen-Vorwärm- und Einschaltvorgangs. Wenn die elektronische Steuerung Dieser DTC erscheint, wenn die Einheit (ECU) feststellt, dass die Glühkerzen-Steuerstromkreisspannung von Zylinder 8 unter dem kalibrierten Mindestwert liegt."
