		"zs": "Die Funktion der Generatorspannungsüberwachungsschaltung besteht darin, das Generatorspannungssignal als Referenz zur Steuerung der Ladegeschwindigkeit und zur Beurteilung, ob der Generator normal arbeitet, an die elektronische Steuereinheit (ECU) zu senden. Dieser Fehlercode zeigt dies an Die elektronische Steuereinheit (ECU) hat einen Fehler in der Generatorspannungsüberwachungsschaltung erkannt. Die Fehlerursache umfasst die Generatorspannungsüberwachungsschaltung, den Generator oder die ECU."
