		"sys": "Getriebe",
		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeöl-Steuerventils, um das Ausrücken und Einrücken zum Schalten zu steuern. Eine genaue Steuerung des Getriebeöldrucks ist wichtig für ein sanftes Schalten. Die Funktion des Der Getriebeöldrucksensor (TFP) soll den Getriebeöldruck und das elektrische Signal an das Getriebesteuergerät (TCU) als Referenz für den Betrieb des Getriebeöldruck-Steuermagnetventils übertragen."
