		"sys": "Emissionskontrolle",
		"zs": "Das Abgasdruckregelventil ist ein Ventil mit variabler Position. Seine Hauptfunktion besteht darin, den Motor bei extrem niedrigen Außentemperaturen (<5 Grad Celsius) durch Ändern des Abgasdrucks (gesteigerte Motorlast) schnell aufzuheizen. .. Wenn das elektronische Steuergerät (ECU) feststellt, dass die Signalspannung des Abgasdruckregelventil-Positionssensors höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt."
