		"des": "High Voltage System Interlock Circuit Low",
		"sys": "Hybridsystem",
		"zs": "Die Funktion der Hochvolt-Systemverriegelung besteht darin, das Systemhauptrelais zu schließen, wenn die Sicherheitseinrichtung defekt ist (z. B. Ladestecker oder Wandler nicht abgedeckt), wenn das Fahrzeug steht. Wenn das Steuergerät erkennt, dass der Hochspannungs-Sperrkreis fehlerhaft ist, wird dieser Fehlercode angezeigt."
