	"P0669": {
		"zzs": "Alle Autohersteller",
		"dm": "P0669",
		"des": "PCM/ECM/TCU Interner Temperatursensor A Stromkreis hoch",
		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist Zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts für den Motor Eine weitere wichtige Rolle stellt die für die Überwachung der Abgasemissionskontrolle zuständige Komponente dar. Das Transmission Control Module (TCM oder TCU) hilft dem Getriebe bei der Entscheidung, wann und wie die Gänge geschaltet werden sollen dass das Auto die Leistung verbessern, reibungslos schalten und Kraftstoffverbrauch sparen kann.Dieser Fehlercode zeigt an, dass die Signalstromkreisspannung des internen Temperatursensors des Steuermoduls höher als der kalibrierte Maximalwert ist.Der Fehler wird durch den internen Temperatursensor, Schaltkreis, Stecker verursacht , oder Steuermodul."
	},
	"P0425": {
		"zzs": "Alle Autohersteller",
		"dm": "P0425",
		"des": "Schaltkreis des Katalysatortemperatursensors (Bank 1, Sensor 1)",
		"sys": "Emissionskontrolle",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln vor dem Schalldämpfer im Auspuffrohr. Dieser Fehlercode weist auf einen Fehler im Schaltkreis des Katalysatortemperatursensors hin. Zu den Ursachen gehören eine Fehlfunktion des Katalysatortemperatursensors, des Schaltkreises, der Anschlüsse oder der elektronischen Steuereinheit (ECU)."
	},
	"P045E": {
		"zzs": "Alle Autohersteller",
		"dm": "P045E",
		"des": "Regler Abgasrückführung B klemmt offen",
		"sys": "Emissionskontrolle",
		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von der Verbrennungskammer, wodurch die Stickoxidverschmutzung reduziert wird. Wenn die befohlene Abgasrückführungsventilposition (EGR) innerhalb der eingestellten Zeitspanne (4 Sekunden) niedriger als 15 % ist und die tatsächliche EGR-Ventilposition 30 % überschreitet, wird die elektronische Steuereinheit dies tun Betrachten Sie die offene Position des festsitzenden AGR."
	},
