	"P0A04": {
		"zzs": "Alle Autohersteller",
		"dm": "P0A04",
		"des": "Motorelektronik-Kühlmitteltemperatursensorkreis intermittierend",
		"sys": "Hybridsystem",
		"zs": "Das Motor Electronic System Cooling System (MECS) ist ein unabhängiges System, das für die Kühlung des Getriebemotors (z. B. eCVT), des Steuermoduls und des DC/DC-Wandlers sorgt. Es verfügt über einen eigenen Kühler, eine Kühlmittelpumpe und einen Kühlmitteltemperatursensor usw. Der Kühlmitteltemperatursensor des Motorelektroniksystems (MECT) verwendet das Prinzip des Thermistors, um die Temperatur des Kühlmittels des Motorelektroniksystems elektronisch an die elektronische Steuereinheit (ECU) zu übertragen wenn sich die Spannung des Motorelektroniksystem-Kühlmitteltemperatursensors (MECT) innerhalb kurzer Zeit plötzlich ändert."
	},
