		"des": "Druckregelmagnet A",
		"sys": "Getriebe",
		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeöl-Steuerventils, um das Ausrücken und Einrücken zum Schalten zu steuern. Eine genaue Steuerung des Getriebeöldrucks ist wichtig für ein sanftes Schalten. Der Zweck des Druckregel-Magnetventil soll den Druck des Getriebeöls regeln. Die Ursachen für diesen DTC sind ein Ausfall des Stromkreises des Druckregel-Magnetventils (PC), der Anschlüsse oder des Magnetventils selbst. Ein Ausfall des Steuermoduls kann dies ebenfalls verursachen DTC erscheint."
