		"zs": "Die Funktion des Abgastemperatursensors besteht darin, die Abgastemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden. Die durch das richtige Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur ist höher als die Abgastemperatur, die durch das zu fette oder zu magere Luft-Kraftstoff-Verhältnis erzeugt wird. Die Lufttemperatur sollte niedrig sein. Eine zu hohe Abgastemperatur (>160 Grad Celsius) führt zu Motorschäden. Wenn das elektronische Steuergerät (ECU) feststellt dass die Änderung des Abgastemperatursensors nach 10 Minuten Kaltstart des Motors weniger als 40 Grad Celsius beträgt, wird dieser Fehlercode angezeigt."
