		"sys": "Emissionskontrolle",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln befindet sich vor dem Schalldämpfer des Auspuffrohrs. Der Fehlercode zeigt an, dass die Effizienz des Katalysators nach dem Vorglühen unter der eingestellten Mindestgrenze liegt. Die Fehlerursachen umfassen den Katalysator, die Lambdasonde und Schaltkreise, Verbindungen usw. Die Zu den Ursachen des Fehlers gehören das Auspuffrohr oder Abgaslecks in der Nähe des Auspuffkrümmers, Ausfall des Katalysatortanks, Ausfall des Motorkühlmitteltemperatursensors (ECT), Fehlzündung oder Zeitverzögerung des Motors, verschmutztes Öl, Ausfall des Sauerstoffsensors, Kraftstoffsystemdruck zu hoch usw ."
