		"sys": "Kraftstoff oder Luft",
		"zs": "Der Turbolader nutzt das Trägheitsmoment des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, die wiederum das koaxiale Laufrad antreibt, um die Ansaugluft unter Druck zu setzen und so die Leistung des Fahrzeugs zu steigern. Der Ladeluftkühler ( auch Ladeluftkühler genannt) ) wird verwendet, um die aufgeladene Luft vom Kompressor zu kühlen. Nachdem die Luft den Kompressor passiert hat, steigt der Druck und die Temperatur steigt. Die Temperatur der aufgeladenen Luft kann durch den Kompressor-Luftkühler reduziert werden, wodurch die Luft erhöht wird Dichte und Erhöhung der Ladeeffizienz, um die Motorleistung zu verbessern und Emissionen zu reduzieren.Die Funktion des Bypassventils des Ladeluftkühlers besteht darin, einen Teil der Luft vom Luftkühler abzuleiten.Diese Luft wird dann mit der gekühlten Luft vermischt des Luftkühlers und geben Sie dann Motor ein, um sicherzustellen, dass die Ansauglufttemperatur höher als die Tautemperatur ist. Wenn die Steuerkreisspannung des Luftkühler-Bypassventils unter dem kalibrierten Mindestwert liegt, wird dieser Fehlercode angezeigt."
