		"des": "Drosselklappen-/Pedalpositionssensor/Schaltkreis C intermittierend",
		"sys": "Kraftstoff oder Luft",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappen-Referenzbasis für die Ventilöffnung. Dieser Fehlercode weist auf eine plötzliche Änderung der Spannung des Stromkreises des Drosselklappensensors C hin."
