		"zs": "Der Batterietemperatursensor befindet sich am Boden des Autobatteriefachs. Seine Hauptfunktion besteht darin, die Batterietemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen, um die Ladegeschwindigkeit zu bestimmen . Wenn die ECU den Batterietemperatursensor erkennt, dass die Schaltkreisspannung höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt."
