	"P0279": {
		"zzs": "Alle Autohersteller",
		"dm": "P0279",
		"des": "Zylinder 7 Einspritzkreis niedrig",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Schaftnadel und dem Düsenloch des Teils wird mit hoher Geschwindigkeit gesprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern der Öffnungszeitintervall (auch als Impulsbreite bezeichnet) des Einspritzventils Wenn das Einspritzventil des 7. Zylinders Dieser DTC erscheint, wenn die Spannung des Steuerkreises unter dem kalibrierten Mindestwert liegt Zu den Ursachen gehören der Steuerkreis des Einspritzventils, der Stecker oder das Einspritzventil selbst; das Injektorsteuermodul (FICM)."
	},
	"P0700": {
		"zzs": "Alle Autohersteller",
		"dm": "P0700",
		"des": "Getriebesteuerungssystem (MIL-Anforderung)",
		"sys": "Getriebe",
		"zs": "Das Transmission Control Module (TCM oder TCU) hilft dem Getriebe bei der Entscheidung, wann und wie der Gang gewechselt werden soll, indem Informationen von verschiedenen Sensoren und dem Motorsteuermodul gesammelt werden, um die Leistung des Fahrzeugs zu verbessern, reibungslos zu schalten und den Kraftstoffverbrauch zu senken Die Malfunction Indicator Light (MIL) wird auch als Check Engine Light bezeichnet. Ihre Funktion besteht darin, ein gelbes oder rotes Motorsymbol auf der Instrumententafel zu beleuchten, wenn das Steuermodul einen Fehler erkennt. Der Fehlercode zeigt an, dass das Antriebsstrangsystem (ECU) empfangen wurde auf Anforderung von der Transmission Control Unit (TCU) zum Aufleuchten der Störungsanzeigeleuchte."
	},
	"P0390": {
		"zzs": "Alle Autohersteller",
		"dm": "P0390",
		"des": "Schaltkreis Nockenwellensensor B (Bank 2)",
		"sys": "Zündsystem",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt.Die Rolle des Nockenwellenpositionssensors (CMP) besteht darin, die Einstellung der Nockenwellenposition (die relative Position) an die zu übertragen Electronic Control Unit (ECU) in Form eines Spannungssignals. Dieser Fehlercode wird angezeigt, wenn die Electronic Control Unit (ECU) erkennt, dass die Spannung des Nockenwellensensors B außerhalb des kalibrierten Normalbereichs liegt."
	},
	"P0799": {
		"zzs": "Alle Autohersteller",
		"dm": "P0799",
		"des": "Druckregelmagnet C intermittierend",
		"sys": "Getriebe",
		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeöl-Steuerventils, um das Ausrücken und Einrücken zum Schalten zu steuern. Eine genaue Steuerung des Getriebeöldrucks ist wichtig für ein sanftes Schalten. Die Funktion des Das Druckregel-Magnetventil soll den Druck des Getriebeöls steuern. Die Gründe für den Ausfall sind unter anderem, dass der Getriebeölstand zu niedrig ist, das Getriebeöl zu verschmutzt ist, das Getriebeöl-Druckregel-Magnetventil, der Kreislauf, der Stecker oder das Steuermodul usw."
	},
