		"des": "A/C-Verdampfertemperatursensorkreis niedrig",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "Die Funktion des Verdampfertemperatursensors der Klimaanlage besteht darin, die Temperatur im Verdampfer der Klimaanlage in Form eines elektrischen Signals an das Steuergerät der Klimaanlage zu übermitteln, damit die Temperatur im Verdampfer der Klimaanlage zu hoch ist niedrig, der Klimaanlagenkompressor wird ausgeschaltet, um zu verhindern, dass die Klimaanlage einfriert. Wenn die elektronische Steuereinheit (ECU) erkennt, dass die Signalspannung des Verdampfertemperatursensors der Klimaanlage niedriger als der kalibrierte Mindestwert (0,13 Volt) ist, Dieser Fehlercode wird angezeigt. Die Ursache des Fehlers umfasst den Ausfall des Verdampfertemperatursensors der Klimaanlage, Kurzschluss zu Masse, Steckerausfall, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
