		"des": "Evaporative Emission System Pressure Sensor/Switch Range/Performance",
		"sys": "Emissionskontrolle",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank zu einem Speichertank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Motorbrennraum zu spülen Fehlercode erscheint wegen des Problems des Bereichs (Kompensation) des Kraftstofftankdrucksensors. Die Ausgangskompensation des Kraftstofftankdrucksensors beträgt plus oder minus 4,3 cm Wassersäule. Wenn die elektronische Steuereinheit (ECU) erkennt, dass der Kraftstoff Flaschendruck ändert sich innerhalb von 0,1 Sekunden um mehr als 36 cm Wassersäule, Dieser Fehlercode wird angezeigt."
