		"zs": "Die Funktion der Getriebeölpumpe besteht darin, das Getriebeöl bei laufendem Motor mit Arbeitsdruck zu versorgen. Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeölsteuerventils zur Steuerung Dadurch wird das Trennen und Einrücken, das Schalten von Gängen erreicht. Der Zweck der Hilfsgetriebeölpumpe besteht darin, das Getriebeöl mit Druck zu versorgen, wenn der Motor nicht läuft (z. B. beim Ziehen eines Anhängers), um eine Überhitzung des Getriebes zu verhindern."
