		"des": "ECM/PCM-Leistungsrelais-Erfassungsschaltkreis/offen",
		"sys": "Computer- oder Hilfsausgangsschaltung",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts des Motors Eine weitere wichtige Rolle stellt die Überwachung der Komponenten der Abgasreinigung dar. Die Funktion des Relais des Motorsteuergeräts besteht darin, die Stromversorgung des Motorsteuergeräts nach der Zündung aufrechtzuerhalten Wenn das passive Diebstahlschutzsystem (PATS) anzeigt, dass sich der Schlüssel in der Position ON (Betrieb) oder START (Start) befindet und die Zündschalterposition (ISP- R) Stromkreis zeigt OFF (aus), ACC (Zubehör), LOCK (Sperre), der Fehlercode wird angezeigt. Die Fehlerursachen umfassen Zündstromkreissicherung, Zündschalter, ISP-R-Stromkreis, ECU-Relais, passives Diebstahlschutzsystem, Steuergerät usw."
