		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass die Ventile zum optimalen Zeitpunkt öffnen und schließen. Dies optimiert die Effizienz und Leistung des Motors in allen Drehzahlbereichen. Dieser DTC zeigt A (Intake/Left/Front) an. Nockenwellenprofilsteuerung defekt oder in geschlossener Position festgefahren."
