		"zs": "Die Funktion des Parkpositionssensors besteht darin, ein Signal an das elektronische Steuergerät (ECU) zu senden, ob sich der Schalthebel in der Parkposition befindet. Wenn das ECU erkennt, dass die Spannung des Parkpositionssensorkreises die Normalbereich der Kalibrierung, der Fehlercode wird angezeigt."
