		"dm": "P0513",
		"des": "Falscher Wegfahrsperrenschlüssel",
		"sys": "Steuerung der Fahrzeuggeschwindigkeit und Leerlaufdrehzahl",
		"zs": "Die Rolle des Anti-Diebstahl-Steuermoduls besteht darin, sicherzustellen, dass das Auto das Auto nur dann starten lässt, wenn der dedizierte Schlüssel vorhanden ist und zu den verschiedenen Komponenten passt."
