		"zs": "Das Batteriesteuermodul steuert das Batteriegebläse entsprechend dem Signal des Batterietemperatursensors ein/aus. Wenn das Batteriesteuermodul feststellt, dass die Signaldifferenz des Batterietemperatursensors E/F die maximale Grenze des Kalibrierung wird dieser Fehlercode angezeigt."
