	"P0124": {
		"zzs": "Alle Autohersteller",
		"dm": "P0124",
		"des": "Drosselklappen-/Pedalpositionssensor/Schalter A Stromkreis intermittierend",
		"sys": "Kraftstoff oder Luft",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung. Wenn die elektronische Steuereinheit (ECU) eine plötzliche Änderung der Signalspannung des elektronischen Gaspedalpositionssensors 1 erkennt, wird dieser Fehlercode angezeigt."
	},
	"P0478": {
		"zzs": "Alle Autohersteller",
		"dm": "P0478",
		"des": "Abgasdruckregelventil A Kreis hoch",
		"sys": "Emissionskontrolle",
		"zs": "Das Abgasdruckregelventil ist ein Ventil mit variabler Position. Seine Hauptfunktion besteht darin, den Motor bei extrem niedrigen Außentemperaturen (<5 Grad Celsius) durch Ändern des Abgasdrucks (gesteigerte Motorlast) schnell aufzuheizen. .Dieser DTC wird angezeigt, wenn das elektronische Steuergerät (ECU) erkennt, dass die Stromkreisspannung des Abgasdruckregelventils A höher ist als der kalibrierte Maximalwert."
	},
	"P0B6E": {
		"zzs": "Alle Autohersteller",
		"dm": "P0B6E",
		"des": "Hybrid Battery Voltage Sense K Circuit Range/Performance",
		"sys": "Hybridsystem",
		"zs": "Die Funktion der Spannungsüberwachungsschaltung der Hybridbatterie besteht darin, die Spannung des Batterieblocks an das Steuermodul zu übertragen, um das Laden und Entladen des Batterieblocks sowie mögliche Kurzschluss- und Unterbrechungsbedingungen zu überwachen ."
	},
	"P0313": {
		"zzs": "Alle Autohersteller",
		"dm": "P0313",
		"des": "Fehlzündung bei niedrigem Kraftstoffstand erkannt",
		"sys": "Zündsystem",
		"zs": "Zylinderfehlzündung bezieht sich auf das Phänomen, dass das Gemisch aus verschiedenen Gründen während des Motorbetriebs nicht richtig im Zylinder verbrannt werden kann. Wenn das elektronische Steuergerät (ECU) eine Fehlzündung erkennt, kann dies zu Schäden am Katalysator führen Die Fehlerleuchte blinkt und der Motor sollte sofort abgestellt werden. Dieser Fehlercode zeigt an, dass die elektronische Steuereinheit (ECU) 1) eine Zylinderfehlzündung und 2) einen niedrigen Kraftstoffstand erkannt hat."
	},
