		"sys": "Emissionskontrolle",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Speichertank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Das elektronische Steuergerät (ECU) erkennt, dass der Steuerstromkreis des Spülmagnetventils des Kraftstoffdampf-Emissionssystems einen Kurzschluss hat, dann wird dieser Fehlercode angezeigt , EVAP-Behälterleck, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
