		"sys": "Emissionskontrolle",
		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von des Brennraums, wodurch die Stickoxidbelastung verringert wird Wenn das elektronische Steuergerät (ECU) erkennt, dass die Signalspannung des Abgasrückführungssensors (AGR) höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt umfasst einen Fehler im Stecker des DPFE-Sensors, der Stromkreis ist mit dem Pluspol kurzgeschlossen, der Sensor ist selbst ausgefallen, das elektronische Steuermodul (PCM oder ECM) ist ausgefallen usw."
