		"zs": "Die Aufgabe des Ausgangsdrehzahlsensors (OSS) besteht darin, das Drehzahlsignal der Getriebeausgangswelle an die elektronische Steuereinheit (ECU) zu übertragen. Wenn das Fahrzeug normal fährt, wenn die ECU die Störung des. erkennt OSS-Signal, der Fehlercode wird Die Gründe für den Ausfall umfassen die Störung des OSS-Sensors durch nicht standardmäßiges Zubehör, den Ausfall des OSS-Sensors selbst, den Ausfall des Stromkreises, des Steckers, den Ausfall des elektronischen Steuermoduls ( PCM oder ECM) usw."
