		"dm": "P0202",
		"des": "Injektorkreis/Unterbrechung - Zylinder 2",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Schaftnadel und dem Düsenloch des Teils wird mit hoher Geschwindigkeit gesprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern der Öffnungszeitintervall (auch als Impulsbreite bezeichnet) des Injektors Wenn die elektronische Steuereinheit (ECU) Wenn ein Fehler im Steuerkreis des Injektors erkannt wird, wird dieser Fehlercode angezeigt , Fehler des Injektors selbst, Fehler des elektronischen Steuermoduls (PCM oder ECM) usw."
