		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle Mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt. Dies optimiert die Effizienz und Leistung des Motors in allen Drehzahlbereichen. Dieser DTC zeigt B (Exhaust/Right/Rear) Nockenwelle an Fehler im Profilregelkreis."
