		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Kühler-Kühlmitteltemperatursensor (Wassertank) verwendet das Thermistorprinzip, um das Kühlertemperatursignal in Form von Spannung an die elektronische Steuereinheit (ECU) zu übertragen. Wenn die ECU die Kühlerkühlmitteltemperatur (Wassertank) erkennt Die Sensorsignalspannung ist höher als der kalibrierte Maximalwert, der Fehlercode wird angezeigt."
