	"P02EB": {
		"zzs": "Alle Autohersteller",
		"dm": "P02EB",
		"des": "Strombereich/Leistung Diesel-Ansaugluftstrom-Steuermotor",
		"sys": "Kraftstoff oder Luft",
		"zs": "Das Dieselmotor-Ansaugluftstrom-Steuersystem bildet einen effektiven Ansaugwirbel, indem es automatisch den Öffnungswinkel der Drosselklappe steuert und mit dem tangentialen Luftkanal oder dem spiralförmigen Luftkanal zusammenarbeitet und gleichzeitig automatisch die Stärke steuert des Ansaugdralls. Die Regelung verbessert effektiv die Verbrennung des Motors und optimiert damit die Leistungsindikatoren wie Motorleistung und Wirtschaftlichkeit. Zu den Ausfallursachen des P02EB zählen der Ansaugklappen-Stellmotor, dessen Schaltungen, Gelenke oder das Steuergerät ( ECM)."
	},
	"P0A06": {
		"zzs": "Alle Autohersteller",
		"dm": "P0A06",
		"des": "Steuerkreis Motorelektronik Kühlmittelpumpe A niedrig",
		"sys": "Hybridsystem",
		"zs": "Das Motor Electronic System Cooling System (MECS) ist ein unabhängiges System, das für die Kühlung des Getriebemotors (z. B. eCVT), des Steuermoduls und des DC/DC-Wandlers sorgt. Es verfügt über einen eigenen Kühler, eine Kühlmittelpumpe und einen Kühlmitteltemperatursensor usw. Die Kühlmittelpumpe des elektronischen Motorkühlsystems ist eine 12-Volt-Elektropumpe, die von einer elektronischen Steuereinheit (ECU) gesteuert wird. Wenn das Steuermodul feststellt, dass die Steuerkreisspannung der Kühlmittelpumpe des elektronischen Motorkühlsystems unter dem kalibrierten Mindestwert liegt, Der Fehlercode wird angezeigt."
	},
