		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der 2. Sensor bezieht sich immer auf die nachgeschaltete Lambdasonde (nach dem Katalysator). Dieser Fehlercode tritt auf, wenn die Spannung des Signals der beheizten Lambdasonde für eine bestimmte Zeit unter 156 mV bleibt. Die Ursache für die Der Fehler umfasst die Verunreinigung des Sauerstoffsensors aufgrund von Silizium im Kraftstoff, das Signal des Sauerstoffsensors und der Massekabelkreis kreuzen sich, der Signalkreis des Sauerstoffsensors ist gegen Masse kurzgeschlossen, der Sauerstoffsensor selbst ist defekt, das elektronische Steuermodul (PCM oder ECM) ist defekt usw."
