		"des": "Keine Aktivität des O2-Sensorschaltkreises erkannt (Bank 1, Sensor 2)",
		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), Der zweite Sensor bezieht sich immer auf die nachgeschaltete Lambdasonde (nach dem Katalysator). Die elektronische Steuereinheit (ECU) überwacht kontinuierlich die beheizte Lambdasonde und hat festgestellt, dass die Lambdasonde funktioniert. Wenn die beheizte Lambdasonde Wenn der Signalwert weiterhin auf dem Standardwert bleibt, gibt die ECU den Befehl Das oszillierende Luft/Kraftstoff-Verhältnis versucht, einige Änderungen im Signalwert zu erkennen. Wenn die ECU die Änderung des Sensorsignals zu diesem Zeitpunkt immer noch nicht erkennen kann, wird der Fehlercode dies tun erscheinen. Die Ursache des Fehlers umfasst ein Leck im Auspuffkrümmer oder Auspuffrohr, einen Ausfall des Sauerstoffsensors selbst oder seiner Schaltkreise oder Anschlüsse, einen Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
