		"sys": "Kraftstoff oder Luft",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Düsenloch wird mit hoher Geschwindigkeit ausgestoßen, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern des Öffnungszeitintervalls ( auch als Impulsbreite bezeichnet) des Einspritzventils. Wenn das Einspritzventil des vierten Zylinders Die Spannung des Steuerkreises höher als der kalibrierte Maximalwert ist, wird dieser Fehlercode angezeigt. Die Fehlerursache umfasst den Steuerkreis des Einspritzventils, den Stecker oder das Einspritzventil selbst; das Injektorsteuermodul (FICM)."
