		"sys": "Emissionskontrolle",
		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von des Brennraums, wodurch die Stickoxidbelastung verringert wird Wenn das elektronische Steuergerät (ECU) erkennt, dass die Signalspannung des Abgasrückführungssensors (EGR) niedriger als der kalibrierte Mindestwert (0,2 V) ist, wird dieser Fehlercode angezeigt Die Fehlerursache umfasst einen fehlerhaften Stecker des DPFE-Sensors, einen Kurzschluss gegen Masse, einen Ausfall des Sensors selbst, einen Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
