		"zs": "Die Funktion des Abgastemperatursensors besteht darin, die Abgastemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden. Die durch das richtige Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur ist höher als die Abgastemperatur, die durch das zu fette oder zu magere Luft-Kraftstoff-Verhältnis erzeugt wird. Die Lufttemperatur sollte niedrig sein. Eine zu hohe Abgastemperatur (>160 Grad Celsius) führt zu Motorschäden. Wenn das elektronische Steuergerät (ECU) erkennt dass die Signalspannung des Abgastemperatursensors innerhalb eines festgelegten Zeitraums (15 Sekunden) höher als 4,75 Volt (und möglicherweise 2,5 Volt) ist, wird der DTC angezeigt."
