		"des": "Beheizter Sauerstoffsensor 2 - Oberhalb Fettgrenze (Bank 4)",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher Katalysator), Der 2. Sensor bezieht sich immer auf den nachgeschalteten Sauerstoffsensor (nach dem Katalysator). Ausfallursachen sind Luftfilter, Verdunstungsemissionssystem (EVAP), Kraftstoffdruck zu hoch oder Injektorleck, Sauerstoffsensor oder sein Schaltkreis, Verbindungsfehler Warten."
