		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Rolle der Zündspule besteht darin, die 12-Volt-Spannung der Autobatterie in Tausende oder sogar Zehntausende von Volt umzuwandeln, die für die Zündkerzenzündung erforderlich sind. Es gibt zwei Spulensätze in der Zündspule, die Primärspule und Sekundärspule. Die Primärspule hat dickeren Lackdraht mit weniger Windungen; die Sekundärspule verwendet dünneren Lackdraht, der relativ mehr Windungen hat. Wenn die Primärspule eingeschaltet wird, wird um sie herum ein starkes Magnetfeld erzeugt Strom steigt, und der Eisenkern speichert Magnetfeldenergie; Wenn das Schaltgerät den Primärspulenkreis trennt, baut sich das Magnetfeld der Primärspule schnell ab und in der Sekundärspule wird eine hohe Spannung induziert. Neue Autos verwenden keine Verteiler mehr, sondern mehrere unabhängige Zündspulen elektronisch steuern und die einzelnen Zylinder einzeln zünden."
