		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Das Zündsteuermodul ist ein Festkörperschaltgerät, das den Betrieb der Zündspule steuert. Mögliche Positionen für das Zündsteuermodul sind außerhalb des Motors, im Verteiler oder integriert mit dem Antriebsstrangsteuermodul (PCM) Die Funktion der Zündspule besteht darin, die 12 Volt der Autobatterie in Tausende oder sogar Zehntausende von Volt umzuwandeln, die für die Zündkerzenzündung erforderlich sind.Es gibt zwei Sätze von Spulen in der Zündspule, Primärspule und Sekundärspule Die Spule hat einen dickeren Lackdraht, die Anzahl der Windungen ist geringer; die Sekundärspule verwendet einen dünneren Lackdraht und die Anzahl der Windungen ist relativ groß. Wenn die Primärspule eingeschaltet wird, wird ein starkes Magnetfeld mit der Erhöhung der erzeugt Strom, und der Eisenkern speichert die Magnetfeldenergie; Wenn das Schaltgerät den Primärspulenkreis öffnet, zerfällt das Magnetfeld der Primärspule schnell und die Sekundärspule induziert eine hohe Spannung."
