		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeölsteuerventils, um das Aus- und Einrücken zum Schalten zu steuern. Zu den Ursachen dieses Fehlercodes gehört ein zu hoher Getriebeölstand. Niedrig , Getriebeöl ist zu verschmutzt, mechanischer Defekt des Schaltmagnetventils, Stromkreis, Stecker oder Defekt des Getriebesteuermoduls (TCM) usw."
