		"des": "Ansaugkrümmer-Luftsteuermagnet (kurzer Läufer)",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Ansaugkrümmer-Luftsteuerungsbaugruppe (IMAC) befindet sich zwischen dem Ansaugkrümmer und dem Zylinderkopf. Um die Motorleistung zu verbessern, entspricht jeder Zylinder zwei Einlasskanälen, von denen einer immer offen ist, der andere nur öffnet wenn die Drehzahl über einem bestimmten Wert liegt (z. B. 3000 U / min). Die Rolle des IMAC-Ausführungsmotors besteht darin, die Ventilklappe des Einlasskanals gemäß dem Befehl der elektronischen Steuereinheit (ECU) zu öffnen / zu schließen."
