		"des": "CAN-Datenbus, Motorsteuergerät - Fehlende Informationen",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Controller Area Network (CAN) (kurz CAN oder CAN-Bus) ist ein Automobil-Kommunikationsprotokoll, das sich dadurch auszeichnet, dass Geräte im Netzwerk direkt miteinander kommunizieren können, ohne dass eine Host-Steuerungskommunikation auf dem erforderlich ist Motor Das Steuergerät, auch Motorsteuergerät genannt (bei manchen Autos sind das Motorsteuergerät und das Getriebesteuergerät in ein Antriebsstrangsteuergerät integriert), steuert den Betrieb des gesamten Motors.Seine Hauptfunktion ist die Steuerung die optimale Kraftstoffeinspritzung des Motors, die Menge und den Zeitpunkt der Zündung. Eine weitere wichtige Rolle spielt die Komponente, die für die Überwachung der Abgasreinigung verantwortlich ist."
