		"zs": "Controller Area Network (CAN) (kurz CAN oder CAN-Bus) ist ein Automobil-Kommunikationsprotokoll, das sich dadurch auszeichnet, dass Geräte im Netzwerk direkt miteinander kommunizieren können, ohne dass eine Host-Steuerungskommunikation auf dem erforderlich ist Getriebe Das Steuermodul (TCM oder TCU) hilft dem Getriebe bei der Entscheidung, wann und wie der Gang gewechselt werden soll, indem es Informationen von verschiedenen Sensoren und dem Motorsteuermodul sammelt, um die Leistung des Fahrzeugs zu verbessern, reibungslos zu schalten und den Kraftstoffverbrauch zu senken."
