	"P1327": {
		"zzs": "Audi, Volkswagen",
		"dm": "P1327",
		"des": "Klopfregelgrenze erreicht - Zylinder 3",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Das Powertrain Control Module (PCM) verwendet einen Klopfsensor, um Vibrationen zu erkennen, wenn sich die Motordrehzahl ändert. Der Klopfsensor drückt diese Vibration dann als Spannung aus. Das elektronische Steuergerät (ECU) reagiert bei Bedarf. Vermeiden Sie es, vorbeizuklopfen Verzögerung der Zündung usw. Zu den Fehlerursachen gehören zu niedrige Kraftstoffqualität oder falsche Kraftstoffsorte, lose Motorteile, unzureichendes Drehmoment der Klopfsensorschraube, Ausfall des Klopfsensors selbst oder seines Schaltkreises oder Steckers, des elektronischen Steuermoduls (PCM oder ECM) Ausfall usw."
	},
