		"des": "AT – Schaltstörung",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "In einem Automatikgetriebe steuert das Schaltmagnetventil den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeölsteuerventils, um dessen Ausrücken und Einrücken zum Schalten zu steuern."
