		"zs": "Der Turbolader nutzt den Trägheitsimpuls des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, und die Turbine treibt das koaxiale Laufrad an, um die Ansaugluft unter Druck zu setzen, wodurch die Leistung des Fahrzeugs erhöht wird. Die Rolle des Wastegate Der Aktor soll den Eintritt in die Turbine steuern, indem er den Abgasstrom (unter Umgehung des restlichen Abgases) zur Drehzahlregelung der Turbine und damit zur Einstellung des maximalen Ladedrucks steuert Drucksensor (BPS), wird verwendet, um den Ladedruck in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen."
