		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Speichertank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Das elektronische Steuermodul erkennt ein Leck mit einem Durchmesser, der größer als ein bestimmtes Niveau ist, und dieser Fehlercode wird angezeigt.Die Fehlerursachen umfassen, dass der Kraftstofftankdeckel nicht festgezogen ist, die Rohrleitung des Verdunstungsemissionssystems undicht ist, die Lücke im Vorschuss des Verdunstungsemissionssystems, und das Magnetventil der Kanisterentlüftung (CV) ist geschlossen. Warten Sie nicht."
