		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Funktion des Dieselpartikelfilters (DPF) besteht darin, Partikelschadstoffe und Ruß aus Dieselabgasen zu entfernen. Der Dieselpartikelfilter (DPF) wird im Allgemeinen in zwei Typen unterteilt: erneuerbar und nicht erneuerbar. Erneuerbarer Partikelfilter Der Filter ist in der Regel durch hohe Temperaturen oder durch Oxidation von Partikeln mit Stickoxiden regeneriert Die Funktion des Dieselpartikelfilter (DPF)-Druckgebers besteht darin, Schäden am Motor durch zu hohen Druck, der durch die Verstopfung des Partikelfilters verursacht wird, zu vermeiden und Schäden an zu verhindern des Motors. Bietet Diagnosen für die Regeneration des Partikelfilters."
