		"zs": "Am Ende des Verdichtungstakts des Motors, wenn der Kolben das obere Ende des Hubs erreicht, liefert das Zündsystem einen Hochdruckfunken an die Zündkerze, um das komprimierte Luftgemisch im Arbeitszylinder zu zünden Diese Zeit stellt den Zündzeitpunkt dar. Um die Zündenergie zu maximieren, wird der Zündzeitpunkt im Allgemeinen in dem Moment gezündet, in dem der Kolben kurz davor steht, den oberen Totpunkt zu erreichen, und nicht erst, wenn der obere Totpunkt erreicht ist, dieser voreilt wird als Zündverstellungswinkel (BTDC) bezeichnet."
