		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher Katalysator) Der zweite Sensor bezieht sich immer auf die nachgeschaltete Lambdasonde (nach dem Katalysator) Lambda ist eine andere Art, das Luft-Kraftstoff-Verhältnis auszudrücken (ein Lambda gleich 1 entspricht einem Luft-Kraftstoff-Verhältnis von 14,7: 1, je größer das Lambda, desto magerer das Luft-Kraftstoff-Verhältnis). Nockenwellensteuerungsfehler, Öl zu voll, Verdunstungsemissionssystemfehler, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
