		"zs": "Wenn die Kühlmitteltemperatur einen bestimmten Sollwert erreicht (z. B. wenn die Klimaanlage eingeschaltet ist und das Auto steht), aktiviert das Powertrain Control Module (PCM) den Kühlmittellüfter, um das Kühlen zu unterstützen. "
