		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist um die optimale Kraftstoffeinspritzmenge und den Zündzeitpunkt des Motors zu steuern.Eine weitere wichtige Rolle ist die Komponente, die für die Überwachung der Abgasemissionssteuerung verantwortlich ist.Das Idle Air Control (IAC)-Ventil hat ein bewegliches Nadelventil, das von einem sich präzise bewegenden Schrittmotor gesteuert wird Drosselklappe Im geschlossenen Zustand regelt das IAC-Ventil die Leerlaufdrehzahl, indem es den Luftstrom in der Bypassleitung verändert, um es an die Leerlaufdrehzahl unter verschiedenen Bedingungen anzupassen."
