		"des": "Konstantvariables Getriebe (CVT) - Schlechte Beschleunigung",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "CVT-Technologie (Continuously Variable Transmission) ist die stufenlose Getriebetechnologie, die den Übertragungsriemen und die Haupt- und Antriebsräder mit variablem Arbeitsdurchmesser zur Kraftübertragung verwendet, wodurch die kontinuierliche Änderung des Übersetzungsverhältnisses realisiert werden kann um das Getriebesystem und die beste Anpassung an die Betriebsbedingungen des Motors zu erhalten."
