		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Der Ansaugkrümmer-Absolutdrucksensor (MAP) misst den Druck (Unterdruck) im Ansaugkrümmer. Das Powertrain Control Module (PCM) passt dann die Differenz zwischen Ansaugkrümmerdruck und atmosphärischem Druck an. Die Differenz (linear bezogen auf die Motorlast ) wird als Grundlage für die Bestimmung der grundlegenden Kraftstoffeinspritzmenge des Einspritzventils verwendet, um dem Motor zu helfen, das beste Luft-Kraftstoff-Verhältnis unter verschiedenen Lasten zu erreichen."
