		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Bei einigen Hochleistungsautos ist die Drosselklappe bei sehr geringer Last fast geschlossen und der Motor muss arbeiten, um Ansaugluft zu erhalten. Zu diesem Zeitpunkt ist der Kompressionsdruck des Gemischs im Zylinder gleich ebenfalls sehr niedrig, was zu einem niedrigen Wirkungsgrad führt. Der Zylinder wird deaktiviert. Das System erreicht einen höheren Motorwirkungsgrad, indem es die Einlass- und Auslassventile bestimmter Zylinder schließt."
