		"zs": "Die Funktion des Fahrzeuggeschwindigkeitssensors (VSS) besteht darin, die Geschwindigkeit des Fahrzeugs in Form eines elektrischen Signals an das elektronische Steuergerät (ECU) zu übertragen, das zur Steuerung der Leerlaufdrehzahl des Motors verwendet wird , Schalten des Automatikgetriebes, Sperren des Drehmomentwandlers und Sperren des Motors. Das Öffnen und Schließen des Kühlerlüfters sowie die Referenzbasis für andere Funktionen wie den Tempomat."
