		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln vor dem Schalldämpfer im Auspuffrohr Kraftstofftrimmung ist, wenn das elektronische Steuergerät (ECU) die Kraftstoffzufuhr steuert, indem es die Zeit verlängert oder verringert, in der die Einspritzdüsen geöffnet sind, damit der Motor das optimale Luft-Kraftstoff-Verhältnis (Luft-zu-Benzin-Masse) erreicht Verhältnis von 14,7 : 1).Ein zu fettes Luftverhältnis bedeutet, dass die Kraftstoffzufuhr zu groß ist, und ein zu mageres Luftverhältnis bedeutet, dass die Kraftstoffzufuhr zu gering ist Dazu gehören Luftleckage nach dem Luftstromsensor (MAF), PCV-Systemleckage, Fehlfunktion des Sauerstoffsensors, Abgasleck in der Nähe des Sauerstoffsensors, EGR-Leck, Fehlfunktion des Luftstromsensors (MAF), verschmutzter Kraftstofffilter, unzureichende Kraftstoffzufuhr zur Kraftstoffpumpe, Kraftstoffdruck Fehlfunktion des Reglers, Einspritzdüse verstopft, Fehlfunktion des Motordrehzahlsensors, Ausfall des elektronischen Steuermoduls (PCM oder ECM) usw."
