		"zs": "Die Funktion des Generators besteht darin, einen Teil der mechanischen Energie des Automotors in elektrische Energie umzuwandeln, die das Auto selbst nutzt und die Batterie auflädt. Der Generator hat normalerweise 5 Anschlüsse: S-Anschluss - Überwachung der Batteriespannung , IG-Klemme - verantwortlich für das Einschalten des Zündschalters für den Spannungsregler, L-Klemme - schließt den Stromkreis zur Warnleuchte, B-Klemme - Hauptgenerator-Ausgangsklemme (mit der Batterie verbunden), F-Klemme - Feldbypass für den Spannungsregler Die Methode eines häufig verwendeten Diagnosegenerators besteht darin, die Batteriespannung vor und nach dem Motorstart zu messen. Normalerweise beträgt die Spannung vor dem Start etwa 12 Volt. Die Spannung nach dem Start sollte etwa 14 Volt betragen."
