		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt. Dieser Fehlercode zeigt an, dass die Spannung des Nockenwellenstellers außerhalb des kalibrierten Normalbereichs liegt."
