		"zs": "Die Rolle des Differential-Saugrohrdrucksensors besteht darin, dem Antriebsstrang-Steuermodul (PCM) zu helfen, die Differenz zwischen Ansaugkrümmerdruck und Atmosphärendruck (linear bezogen auf die Motorlast) abzuschätzen, um die Kraftstoffzufuhr zu korrigieren Motor erreicht das beste Luft-Kraftstoff-Verhältnis unter verschiedenen Lasten. Zu den Fehlerursachen gehören der Krümmerdifferenzdrucksensor (MDP) selbst oder sein Schaltkreis oder Verbindungsfehler, der Fehler des elektronischen Steuermoduls (PCM oder ECM) usw. "
