		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch geöffnet, und der Kraftstoff strömt durch den Nadelventilkopf. Der Ringspalt zwischen der Schaftnadel und der Düsenbohrung wird mit hoher Geschwindigkeit ausgestoßen, um einen Nebel zu bilden."
