		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um das Ventil zum optimalen Zeitpunkt zu öffnen und zu schließen. Das optimiert den Wirkungsgrad und die Leistung des Motors in allen Drehzahlbereichen."
