		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle um Mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt Dies optimiert den Wirkungsgrad und die Leistung des Motors in allen Drehzahlbereichen Luftstrom (MAF) Die Rolle des Sensors besteht darin, den Luftstrom umzuwandeln in ein elektrisches Signal umwandeln und es als eines der grundlegenden Signale zur Bestimmung der Kraftstoffeinspritzmenge an die elektronische Steuereinheit (ECU) senden."
