		"dm": "P2113",
		"des": "Drosselklappen-/Pedalpositionssensor B Minimale Stoppleistung",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Bezugsbasis für die Ventilöffnung."
