		"dm": "P245D",
		"des": "Bypass-Steuerkreis Abgasrückführungskühler hoch",
		"sys": "Emissionskontrolle",
		"zs": "Die Aufgabe des Abgasrückführungssystems (AGR) besteht darin, eine kleine Menge Abgas in den Ansaugkrümmer zu leiten, wenn der Motor mit hoher Last läuft. Das Vorhandensein dieser Abgase reduziert die Temperatur und den Druck von des Brennraums und reduziert so die Stickoxid-Schadstoffemissionen."
