		"des": "Katalysatorverschlechterungssensorkreis für direkte Ozonreduktion",
		"sys": "Hilfseingang",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln der Schalldämpfer im Auspuffrohr."
