	"P2720": {
		"zzs": "Alle Autohersteller",
		"dm": "P2720",
		"des": "Steuerstromkreis Druckregelmagnet D zu niedrig",
		"sys": "Getriebe",
		"zs": "Das Schaltmagnetventil steuert den Hydraulikdruck zur Getriebekupplung durch Öffnen oder Schließen des Getriebeöl-Steuerventils, um das Ausrücken und Einrücken zum Schalten zu steuern. Eine genaue Steuerung des Getriebeöldrucks ist wichtig für ein sanftes Schalten. Die Funktion des Das Druckregel-Magnetventil soll den Druck der Getriebeflüssigkeit steuern.Die Gründe für diesen Fehlercode umfassen das Druckregel-Magnetventil selbst, den Stromkreis, den Stecker usw. Gleichzeitig sollte beachtet werden, dass der Ausfall des Das Magnetventil der Getriebesteuerung ist in einigen Fällen nicht auf elektronische Probleme zurückzuführen, sondern auf verstopfte Leitungen oder mechanische Probleme. Oftmals führt nur die Tatsache, dass das Getriebeöl zu schmutzig ist, zu vielen dieser Ausfälle."
	},
	"P2017": {
		"zzs": "Alle Autohersteller",
		"dm": "P2017",
		"des": "Ansaugkrümmerkanal-Positionssensor/Schaltkreis hoch (Bank 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Ansaugkrümmer-Durchgangssteuerungsbaugruppe (IMRC) befindet sich zwischen dem Ansaugkrümmer und dem Zylinderkopf. Um die Motorleistung zu verbessern, entspricht jeder Zylinder zwei Einlasskanälen, von denen einer immer offen ist und der andere nur öffnet wenn die Drehzahl über einem bestimmten Wert liegt (z. B. 3000 U / min). Die Aufgabe des Positionssensors für den Einlasskrümmerkanal besteht darin, das Öffnen der Kanalklappe in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen."
	},
	"P247C": {
		"zzs": "Alle Autohersteller",
		"dm": "P247C",
		"des": "Abgastemperatur außerhalb des Bereichs (Bank 2 Sensor 1)",
		"sys": "Emissionskontrolle",
		"zs": "Die Funktion des Abgastemperatursensors besteht darin, die Abgastemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden. Die durch das richtige Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur ist höher niedriger als die durch zu fettes oder zu mageres Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur. Niedrige Lufttemperatur. Überhöhte Abgastemperatur (>160 °C) kann den Motor beschädigen."
	},
	"P2191": {
		"zzs": "Alle Autohersteller",
		"dm": "P2191",
		"des": "System zu mager bei höherer Last (Bank 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Kraftstofftrimmung ist, wenn die elektronische Steuereinheit (ECU) die Kraftstoffzufuhr steuert, indem sie die Öffnungszeit der Einspritzdüsen erhöht oder verringert, damit der Motor das optimale Luft-Kraftstoff-Verhältnis (14,7:1 Luft-zu-Benzin-Masse) erreicht Verhältnis) .Ein zu fettes Luft-Luft-Verhältnis bedeutet, dass die Kraftstoffzufuhr zu groß ist, und ein zu mageres Luft-Luft-Verhältnis bedeutet, dass die Kraftstoffzufuhr zu gering ist Die Kraftstoffmenge (relativer Lufteinlass) ist niedrig. Die Ursachen des Ausfalls umfassen Luftstrom (MAF), Luftleck hinter dem Sensor, Leck im PCV-System, Ausfall des Sauerstoffsensors, Abgasleck in der Nähe des Sauerstoffsensors, EGR-Leck, verschmutzter Luftstrom (MAF ) Sensor, verstopfter Injektor, unzureichende Versorgung der Kraftstoffpumpe usw."
	},
	"P2A04": {
		"zzs": "Alle Autohersteller",
		"dm": "P2A04",
		"des": "Reichweite/Leistung des Schaltkreises des O2-Sensors (Bank 2 Sensor 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), der zweite Sensor ist immer die nachgeschaltete Lambdasonde (nach dem Katalysator)."
	},
