		"zs": "Diesel Exhaust Fluid (DEF), auch Reduktionsmittel genannt, ist eine 32,5-prozentige Mischung aus Harnstoff und Wasser. Wird es in den Auspuff eingespritzt, wandelt es Stickoxide in unschädlichen Stickstoff und Wasser um."
