		"zs": "Wenn die Temperatur des Dieselabgassystems hoch genug ist, kann der Dieselpartikelfilter (DPF) passiv regeneriert werden (Oxidation der Kohlenstoffablagerungen auf dem Filter). Wenn die Temperatur des Abgassystems nicht hoch genug ist, Die aktive DPF-Regeneration erfolgt durch Einspritzen einer kleinen Menge Kraftstoff stromaufwärts des Dieseloxidationskatalysators (DOC), um die Temperatur des Abgassystems zu erhöhen. Beachten Sie, dass dieser eingespritzte Kraftstoff nicht im Abgassystem verbrennt."
