	"P2240": {
		"zzs": "Alle Autohersteller",
		"dm": "P2240",
		"des": "O2 Sensor positiver Stromregelkreis/offen (Bank 2 Sensor 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), der zweite Sensor ist immer die nachgeschaltete Lambdasonde (nach dem Katalysator)."
	},
	"P229D": {
		"zzs": "Alle Autohersteller",
		"dm": "P229D",
		"des": "Kraftstoffdruckregler 2 hat Lerngrenzen überschritten - zu hoch",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Kraftstoffdruckregler verwendet ein federgetriebenes Ventil, um überschüssiges Benzin zurück in den Tank zu leiten und hält so den Druck im Kraftstoffkreislauf konstant unterschiedlichen Motorbetriebsbedingungen (Beurteilung der Motorlast anhand des Vakuumgrads). Die Kraftstoffdruckregler der meisten Autos befinden sich am Kraftstoffabzweigrohr, aber die Kraftstoffdruckregler einiger Autos befinden sich im Kraftstofftank. "
	},
	"P20A5": {
		"zzs": "Alle Autohersteller",
		"dm": "P20A5",
		"des": "Steuerventil für Reduktionsmittelspülung klemmt geschlossen",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Diesel Exhaust Fluid (DEF), auch Reduktionsmittel genannt, ist eine Mischung aus 32,5 % Harnstoff und Wasser. In den Auspuff eingespritzt, kann es Stickoxide in unschädlichen Stickstoff und Wasser umwandeln. Reduktion Die Mittelpumpe Die Baugruppe enthält eine Druckpumpe, einen Drucksensor, ein Spülventil, einen Auslassfilter und ein internes Heizelement. Die Rolle des Reduktionsmittel-Drucksensors besteht darin, die Pumpendrehzahl für das PCM durch Pulsweitenmodulation (PCM) zu steuern und dadurch zu regulieren Systemdruck, um Rückmeldung zu geben. Wenn das PCM eine Reduktionsmitteleinspritzung anfordert, öffnet sich der Reduktionsmittelinjektor und die Pumpe läuft, liefert Druck an die ursprüngliche Druckleitung und die Injektoren und spült Luft aus dem System. Wenn die gesamte Luft gespült wurde, wird Kraftstoff eingespritzt Die Pumpe schaltet ab und die Pumpe stellt einen Druck von etwa 500 kPa bereit, um die Reduktionsmitteleinspritzung vorzubereiten."
	},
	"P2749": {
		"zzs": "Alle Autohersteller",
		"dm": "P2749",
		"des": "Zwischenwellendrehzahlsensor C Schaltkreis",
		"sys": "Getriebe",
		"zs": "Die Hauptkomponente des Getriebes besteht aus einem Planetengetriebe auf einer Zwischenwelle. Es ist auf der einen Seite mit der Eingangswelle und auf der anderen Seite mit der Ausgangswelle verbunden."
	},
	"P2660": {
		"zzs": "Alle Autohersteller",
		"dm": "P2660",
		"des": "B-Kipphebel-Stellglied-Steuerstromkreis/offen (Bank 2)",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "In einem variablen Ventilsteuerungssystem ist der Kipphebel eine Vorrichtung, die die Nockenwelle und das Ventil verbindet. Das elektronische Steuermodul kann den Winkel der Nockenwelle einstellen, indem es den Öldruck zum Kipphebelaktuator ändert, um sicherzustellen, dass die Ventile öffnen und schließen zum optimalen Zeitpunkt. Das optimiert die Effizienz und Leistung des Motors in allen Drehzahlbereichen."
	},
	"P2769": {
		"zzs": "Alle Autohersteller",
		"dm": "P2769",
		"des": "Drehmomentwandler-Kupplungskreis niedrig",
		"sys": "Getriebe",
		"zs": "Der Drehmomentwandler wirkt wie eine Kupplung in einem Handschaltgetriebe, wodurch das Drehmoment des Motors vorübergehend vom Getriebe getrennt werden kann, um sanfte Schaltvorgänge zu ermöglichen. Der Unterschied besteht jedoch darin, dass der Drehmomentwandler als drehmomenterhöhender Effekt wirken kann wie ein Herunterschalten."
	},
	"P2701": {
		"zzs": "Alle Autohersteller",
		"dm": "P2701",
		"des": "Getriebereibungselement B Anwenden Zeitbereich/Leistung",
		"sys": "Getriebe",
		"zs": ""
	},
	"P251D": {
		"zzs": "Alle Autohersteller",
		"dm": "P251D",
		"des": "Zapfwellenmotor-Abschaltkreis/offen",
		"sys": "Hilfseingang",
		"zs": "PTO ist die Abkürzung für Power Take-off. Es bezieht sich normalerweise auf ein Gerät, das zusätzliche Komponenten mit Strom versorgt."
	},
	"P2589": {
		"zzs": "Alle Autohersteller",
		"dm": "P2589",
		"des": "Turbolader-Boost-Steuerungspositionssensor B Stromkreis hoch",
		"sys": "Hilfseingang",
		"zs": "Der Turbolader nutzt das Trägheitsmoment des vom Motor abgegebenen Abgases, um die Turbine anzutreiben, und die Turbine treibt das koaxiale Laufrad an, um die Ansaugluft zu verstärken, wodurch die Leistung des Fahrzeugs erhöht wird. Der Turbo/Kompressor-Boost Controller Die Funktion besteht darin, dass, wenn der Ladedruck den eingestellten Wert erreicht, der Luftdruck den Wastegate-Aktuator (pneumatisch-mechanischer Typ) drückt, um einen Teil des Abgases von der Turbine zu umgehen, wodurch die Turbinendrehzahl reduziert und das Ladedruckniveau gesteuert wird Boost-Control-Positionssensor Die Rolle besteht darin, die Position des Wastegate-Ventils zu überwachen."
	},
	"P2619": {
		"zzs": "Alle Autohersteller",
		"dm": "P2619",
		"des": "Kurbelwellenpositionssignal-Ausgangsschaltung hoch",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "Die Funktion der Kurbelwelle besteht darin, die Auf- und Abwärtsbewegung des Kolbens in eine Drehbewegung umzuwandeln. Der Kurbelwellenpositionssensor (CKP) (auch oberer Totpunktsensor genannt) wird verwendet, um den oberen Totpunkt zu erfassen (TDC)-Signal und das Kurbelwellenwinkelsignal und das Motordrehzahlsignal und geben es in den Computer ein, damit der Computer den optimalen Zündzeitpunktbefehl entsprechend der Zündfolge der Zylinder ausgeben kann."
	},
	"P2255": {
		"zzs": "Alle Autohersteller",
		"dm": "P2255",
		"des": "O2-Sensor-Negativstrom-Steuerkreis niedrig (Bank 2 Sensor 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), der zweite Sensor ist immer die nachgeschaltete Lambdasonde (nach dem Katalysator)."
	},
	"P2166": {
		"zzs": "Alle Autohersteller",
		"dm": "P2166",
		"des": "Gas-/Pedalpositionssensor D Maximale Stoppleistung",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Bezugsbasis für die Ventilöffnung."
	},
	"P2068": {
		"zzs": "Alle Autohersteller",
		"dm": "P2068",
		"des": "Stromkreis Kraftstoffstandsensor B hoch",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Kraftstoffstandsensor nutzt das Prinzip eines Schwimmers im Kraftstofftank und eines variablen Widerstands, um den Kraftstoffstand im Kraftstofftank in Form eines elektrischen Signals an das elektronische Steuergerät zu übermitteln."
	},
