	"P207B": {
		"zzs": "Alle Autohersteller",
		"dm": "P207B",
		"des": "Intake Manifold Tuning (IMT) Valve Position Sensor/Switch Circuit Range/Performance (Bank 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Bei optimaler Länge des Ansaugkrümmerkanals (Läufer) hilft die durch das Schließen der Ventile erzeugte Druckwelle, das Öl-Luft-Gemisch in den Motor zu leiten. Das Problem ist, dass die optimale Länge des Ansaugkrümmerkanals für unterschiedliche Motordrehzahlen ist auch anders. Die Rolle des Manifold Tuning Valve (MTV) besteht darin, das Drehmoment des Motors bei unterschiedlichen Drehzahlen zu optimieren, indem die Ansaugluft je nach Motordrehzahl in die Ansaugkrümmerkanäle unterschiedlicher Länge geleitet wird."
	},
	"P2641": {
		"zzs": "Alle Autohersteller",
		"dm": "P2641",
		"des": "Drehmomentmanagement-Feedbacksignal B",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "Die Funktion des Drehmomentmanagementsystems besteht darin, das Drehmoment des Motors durch vorübergehendes Schließen des Einspritzventils oder Verzögern der Zündung während des Schaltens des Getriebes oder des Radschlupfs zu reduzieren, um das Schalten sanfter zu machen und den Verschleiß zu verringern Antriebsstrang."
	},
	"P2609": {
		"zzs": "Alle Autohersteller",
		"dm": "P2609",
		"des": "Intake Air Heater System Performance 7",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "Der Ansaugvorwärmer, auch Saugrohrvorwärmer genannt, dient zur Zufuhr vorgewärmter Luft, um den Dieselmotor bei kaltem Wetter leicht starten zu lassen."
	},
	"P209C": {
		"zzs": "Alle Autohersteller",
		"dm": "P209C",
		"des": "Reduktionsmittel-Einspritzluftdrucksensor B Schaltkreis niedrig",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Diesel Exhaust Fluid (DEF), auch Reduktionsmittel genannt, ist eine Mischung aus 32,5 % Harnstoff und Wasser. In den Auspuff eingespritzt, kann es Stickoxide in unschädlichen Stickstoff und Wasser umwandeln. Reduktion Die Mittelpumpe Die Baugruppe enthält eine Druckpumpe, einen Drucksensor, ein Spülventil, einen Auslassfilter und ein internes Heizelement. Die Rolle des Reduktionsmittel-Drucksensors besteht darin, die Pumpendrehzahl für das PCM durch Pulsweitenmodulation (PCM) zu steuern und dadurch zu regulieren Systemdruck, um Rückmeldung zu geben. Wenn das PCM eine Reduktionsmitteleinspritzung anfordert, öffnet sich der Reduktionsmittelinjektor und die Pumpe läuft, liefert Druck an die ursprüngliche Druckleitung und die Injektoren und spült Luft aus dem System. Wenn die gesamte Luft gespült wurde, wird Kraftstoff eingespritzt Die Pumpe schaltet ab und die Pumpe stellt einen Druck von etwa 500 kPa bereit, um die Reduktionsmitteleinspritzung vorzubereiten."
	},
