		"zs": "Die Funktion des Klimaanlagen-Kältemitteldrucksensors besteht darin, den Klimaanlagen-Kältemitteldruck in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen, als Grundlage für die Steuerung des Kühlgebläseschalters und Kompressorrelais."
