		"des": "Wasser im Kraftstoffsensorschaltkreis hoch",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Wasser-in-Kraftstoff-Sensor (WIF) erkennt den Wassergehalt im Diesel anhand des Leitfähigkeitsunterschieds zwischen Wasser und Diesel, um Schäden am Injektor durch Wasser zu vermeiden."
