	"P2016": {
		"zzs": "Alle Autohersteller",
		"dm": "P2016",
		"des": "Ansaugkrümmerkanal-Positionssensor/Schaltkreis niedrig (Bank 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Ansaugkrümmer-Durchgangssteuerungsbaugruppe (IMRC) befindet sich zwischen dem Ansaugkrümmer und dem Zylinderkopf. Um die Motorleistung zu verbessern, entspricht jeder Zylinder zwei Einlasskanälen, von denen einer immer offen ist und der andere nur öffnet wenn die Drehzahl über einem bestimmten Wert liegt (z. B. 3000 U / min). Die Aufgabe des Positionssensors für den Einlasskrümmerkanal besteht darin, das Öffnen der Kanalklappe in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu übertragen."
	},
	"P222A": {
		"zzs": "Alle Autohersteller",
		"dm": "P222A",
		"des": "Barometrischer Drucksensor B Schaltkreis",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Rolle des barometrischen Drucksensors (manchmal auch High Altitude Compensator, HAC genannt) besteht darin, den barometrischen Druck als elektrisches Signal an das elektronische Steuermodul zu senden. Der barometrische Druck variiert mit Wetter und Höhe. Je niedriger der Druck , desto magerer die Luft. Das Powertrain Control Module (PCM) passt die Kraftstoffzufuhr basierend auf dem barometrischen Druckwert an, um dem Motor zu helfen, das optimale Luft-Kraftstoff-Verhältnis zu erreichen."
	},
