		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Abgastemperatursensors besteht darin, die Abgastemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden. Die durch das richtige Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur ist höher niedriger als die durch zu fettes oder zu mageres Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur. Niedrige Lufttemperatur. Überhöhte Abgastemperatur (>160 °C) kann den Motor beschädigen."
