		"sys": "Emissionskontrolle",
		"zs": "Wenn der Motor gerade gestartet wird, oxidiert das Sekundärluft-Einspritzsystem die erzeugten Kohlenwasserstoffe, Kohlenmonoxid und andere schädliche Gase, indem es Luft in den Abgaskrümmer drückt. Dieser Vorgang beschleunigt auch die Erwärmung des Katalysators. Prozess."
