		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung verändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Öldruck zum Nockenwellenversteller (mechanisch) passt den Winkel der Nockenwelle an, um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt."
