		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher Katalysator) Der zweite Sensor bezieht sich immer auf den nachgeschalteten Sauerstoffsensor (nach dem Katalysator) Dieser Fehlercode zeigt an, dass das elektronische Steuergerät (ECU) einen Fehler im 5-Volt-Referenzspannungskreis des Sauerstoffsensors erkannt hat. Die Ursache des Fehlers umfasst den 5-Volt-Referenzspannungskreis des Sauerstoffsensors zu einem bestimmten kurzgeschlossenen oder kurzgeschlossenen Stromkreis eines Sensors, einem kurzgeschlossenen oder offenen Stromkreis eines oder mehrerer Sensoren, einer ECU usw."
