		"zs": "Das Verdunstungsemissionssystem (EVAP) leitet Benzindämpfe aus dem Kraftstofftank in einen Vorratstank, der Aktivkohle enthält, die Benzindämpfe absorbiert. Der Motor verwendet dann Frischluft, um diese Benzindämpfe in den Brennraum des Motors zu spülen Die Rolle des Diagnosemoduls besteht darin, mithilfe der Lecksuchpumpe (LDP) einen geringen Druck auf das Verdunstungsemissionssystem (EVAP) und das Kraftstoffsystem auszuüben und dann das System auf Undichtigkeiten zu erkennen, um sicherzustellen, dass keine schädlichen Dämpfe in das Kraftstoffsystem entweichen Atmosphäre."
