		"zs": "Die Aufgabe des Stickoxidsensors besteht darin, den Stickoxidgehalt im Abgas in Form eines elektrischen Signals an das Powertrain Control Module (PCM) zu übermitteln und so eine Rückmeldung für die Verbrennung zur Reduzierung des Stickstoffgehalts zu geben oxidische Schadstoffemission."
