		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung Zu den Gründen für den Ausfall gehören Kurzschluss des Gaspedalpositionssensorkreises (APP) zum Pluspol, Ausfall des APP-Sensors selbst, Ausfall des elektronischen Steuermoduls ( PCM oder ECM) usw."
