		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Diesel Exhaust Fluid (DEF), auch Reduktionsmittel genannt, ist eine Mischung aus 32,5 % Harnstoff und Wasser. In den Auspuff eingespritzt, kann es Stickoxide in unschädlichen Stickstoff und Wasser umwandeln. Reduktion Der Mitteldruck Der Sensor ist im Allgemeinen in die Reduktionsmittelpumpe integriert. Seine Aufgabe besteht darin, dem PCM Feedback zu geben, um die Pumpendrehzahl durch Pulsweitenmodulation (PCM) zu steuern und dadurch den Systemdruck zu regulieren."
