		"zs": "Die Funktion des Dieselpartikelfilters (DPF) besteht darin, Partikelschadstoffe und Ruß aus Dieselabgasen zu entfernen. Dieselpartikelfilter (DPF) werden im Allgemeinen in zwei Typen unterteilt: erneuerbare und nicht erneuerbare. Erneuerbare Partikelfilter Im Allgemeinen die Der Filter wird durch hohe Temperaturen oder durch Oxidieren von Partikeln mit Stickoxiden regeneriert Die Rolle des Drucksensors des Dieselpartikelfilters (DPF) besteht darin, Schäden am Motor aufgrund von zu hohem Druck, der durch die Verstopfung des Partikelfilters verursacht wird, und an den Partikeln zu vermeiden Filter. Regeneration liefert Diagnose."
