		"des": "Throttle Actuator Control System - Forced Limited RPM",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Bezugsgröße für die Klappenöffnung Drosselklappenstellglied ist ein Schrittmotor, der für die Steuerung der Drosselklappenöffnung gemäß den Anweisungen des Drosselklappensteuermoduls zuständig ist Die Fehlerursache liegt in der elektronischen Steuerung Fehler des Moduls (PCM oder ECM. Es wird empfohlen, den Fehler zu löschen. Wenn derselbe Fehlercode erneut auftritt, muss das elektronische Steuermodul ausgetauscht werden."
