		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung Der Drosselklappenstellglied ist ein Schrittmotor, der für die Steuerung der Öffnung der Drosselklappe gemäß den Anweisungen des Drosselklappensteuermoduls verantwortlich ist, wenn das elektronische Steuermodul dies erkennt arbeitet im Failed Mode Effects Management (FMEM)-Modus Wenn sich das Steuermotorsystem des Drosselklappenstellglieds (TACM) im erzwungenen Modus mit begrenzter Leistung befindet, wird dieser Fehlercode angezeigt. PCM oder ECM) Fehler usw."
