	"P212E": {
		"zzs": "Alle Autohersteller",
		"dm": "P212E",
		"des": "Drosselklappenstellungssensor/Schaltkreis G intermittierend",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Drosselklappe, allgemein bekannt als Drosselklappe, ist ein steuerbares Ventil, das zur Steuerung des Ansaugluftvolumens des Motors verwendet wird. Die Funktion des Drosselklappenstellungssensors (TP) besteht darin, die Drosselklappenöffnung in Form einer elektrisches Signal an die elektronische Steuereinheit (ECU) als einen der grundlegenden Parameter für die Steuerung der Motorkraftstoffeinspritzung."
	},
	"P264D": {
		"zzs": "Alle Autohersteller",
		"dm": "P264D",
		"des": "Ein Kipphebel-Stellglied-Positionssensorschaltkreis hoch (Bank 1)",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "In einem variablen Ventilsteuerungssystem ist der Kipphebel eine Vorrichtung, die die Nockenwelle und das Ventil verbindet. Das elektronische Steuermodul kann den Winkel der Nockenwelle einstellen, indem es den Öldruck zum Kipphebelaktuator ändert, um sicherzustellen, dass die Ventile öffnen und schließen zum optimalen Zeitpunkt. Das optimiert die Effizienz und Leistung des Motors in allen Drehzahlbereichen."
	},
	"P20CB": {
		"zzs": "Alle Autohersteller",
		"dm": "P20CB",
		"des": "Steuerstromkreis Abgasnachbehandlung Kraftstoffeinspritzventil A/offen",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Dieselpartikelfilter (DPF) (DPF) kann passiv regeneriert werden (Oxidation von Kohlenstoffablagerungen vom Filter), wenn die Temperatur des Dieselabgassystems hoch genug ist. Wenn die Temperatur des Abgassystems nicht hoch genug ist, aktive DPF-Regeneration kann durch Einspritzen einer kleinen Kraftstoffmenge stromaufwärts des Diesel-Oxidationskatalysators (DOC) durchgeführt werden, um die Temperatur des Abgassystems zu erhöhen. Beachten Sie, dass dieser eingespritzte Kraftstoff nicht im Abgassystem verbrennt."
	},
	"P2666": {
		"zzs": "Alle Autohersteller",
		"dm": "P2666",
		"des": "Kraftstoffabsperrventil B Steuerkreis niedrig",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "Die Funktion des Kraftstoffabsperrventils besteht darin, die Kraftstoffzufuhr zum Motor im Notfall (z. B. bei einem Überschlag) zu unterbrechen. Wenn die elektronische Steuereinheit (ECU) erkennt, dass der Kraftstoff abgeschaltet ist Wenn die Steuerstromkreisspannung des Abschaltventils B niedriger als der kalibrierte niedrigste Wert ist, wird der DTC angezeigt."
	},
	"P2099": {
		"zzs": "Alle Autohersteller",
		"dm": "P2099",
		"des": "Kraftstofftrimmsystem nach dem Katalysator zu fett (Bank 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Ein Katalysator (auch Katalysator genannt) ist eine Abgasreinigungsvorrichtung, die die Wirkung eines Katalysators nutzt, um CO, HC und NOx im Abgas in für den menschlichen Körper unschädliche Gase umzuwandeln vor dem Schalldämpfer im Auspuffrohr Kraftstofftrimmung ist, wenn das elektronische Steuergerät (ECU) die Kraftstoffzufuhr steuert, indem es die Zeit verlängert oder verringert, in der die Einspritzdüsen geöffnet sind, damit der Motor das optimale Luft-Kraftstoff-Verhältnis (Luft-zu-Benzin-Masse) erreicht Verhältnis von 14,7 : 1).Ein zu fettes Luftverhältnis bedeutet eine zu große Kraftstoffzufuhr, ein zu mageres Luftverhältnis bedeutet eine zu kleine Kraftstoffzufuhr Dazu gehören Luftfilter, Verdunstungsemissionssystem (EVAP) und Kraftstoffdruck zu hoch oder undichte Kraftstoffeinspritzdüse, Sauerstoffsensor oder dessen Schaltkreis, Verbindungsfehler usw."
	},
