		"des": "Kreislauf des Kühlmittelregelventils der Reduktionsmittelheizung niedrig",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Diesel Exhaust Fluid (DEF), auch Reduktionsmittel genannt, ist eine Mischung aus 32,5 % Harnstoff und Wasser. In den Auspuff eingespritzt, kann es Stickoxide in unschädlichen Stickstoff und Wasser umwandeln. Reduktion Die Funktion von Die Mittelheizung soll das Reduktionsmittel bei sehr niedrigen Außentemperaturen in flüssigem Zustand halten. Wenn der Reduktionsmitteltemperatursensor erkennt, dass die Temperatur der Dieselabgasflüssigkeit (DEF) auf den Gefrierpunkt (-11 Grad Celsius) fällt, das Antriebsstrang Das Steuergerät (PCM) weist dann das Glühkerzensteuergerät an, die Reduktionsmittelheizung zu aktivieren."
