		"zs": "In einem elektronischen Drosselklappensteuerungssystem (ETC) ist das Drosselklappenstellglied ein Schrittmotor, der die Öffnung der Drosselklappe gemäß den Anweisungen des Drosselklappensteuermoduls steuert."
