		"des": "Drosselklappen-/Pedalpositionssensor/Schalter A/B Spannungskorrelation",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung. Zu den Fehlerursachen gehören ETC-Drosselklappenpositionssensor (TP) -Schaltkreis oder Gelenkfehler, TP-Sensor selbst Fehler, Fehler des elektronischen Steuermoduls (PCM oder ECM) usw. "
