		"dm": "P2003",
		"des": "Effizienz des Dieselpartikelfilters unter Schwellenwert (Bank 2)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Dieselpartikelfilters (DPF) besteht darin, Partikelschadstoffe und Ruß aus Dieselabgasen zu entfernen. Dieselpartikelfilter (DPF) werden im Allgemeinen in zwei Typen unterteilt: erneuerbare und nicht erneuerbare. Erneuerbare Partikelfilter sind typischerweise Filter durch hohe Temperatur oder durch Oxidation von Partikeln mit Stickoxiden regeneriert werden."
