	"P2130": {
		"zzs": "Alle Autohersteller",
		"dm": "P2130",
		"des": "Kreis Drosselklappen-/Pedalsensor/Schalter F",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Bezugsbasis für die Ventilöffnung."
	},
	"P216B": {
		"zzs": "Alle Autohersteller",
		"dm": "P216B",
		"des": "Versorgungsspannungskreis Kraftstoffeinspritzdüse Gruppe E niedrig",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Injektors besteht darin, den Kraftstoff zu zerstäuben, damit er den Anforderungen der Verbrennung entspricht. Das Arbeitsprinzip besteht darin, dass bei Erregung der elektromagnetischen Spule eine Saugwirkung erzeugt wird, das Nadelventil angesaugt wird, das Düsenloch wird geöffnet und der Kraftstoff strömt durch den Nadelventilkopf. Der ringförmige Spalt zwischen der Wellennadel und dem Düsenloch wird mit hoher Geschwindigkeit versprüht, um einen Nebel zu bilden. Die elektronische Steuereinheit steuert die Kraftstoffeinspritzmenge durch Steuern des Öffnungszeitintervalls (auch Impulsbreite genannt) des Injektors."
	},
	"P2650": {
		"zzs": "Alle Autohersteller",
		"dm": "P2650",
		"des": "B-Kipphebel-Stellglied-Steuerstromkreis/offen (Bank 1)",
		"sys": "Computer- oder Hilfsausgang",
		"zs": "In einem variablen Ventilsteuerungssystem ist der Kipphebel eine Vorrichtung, die die Nockenwelle und das Ventil verbindet. Das elektronische Steuermodul kann den Winkel der Nockenwelle einstellen, indem es den Öldruck zum Kipphebelaktuator ändert, um sicherzustellen, dass die Ventile öffnen und schließen zum optimalen Zeitpunkt. Das optimiert die Effizienz und Leistung des Motors in allen Drehzahlbereichen."
	},
	"P2122": {
		"zzs": "Alle Autohersteller",
		"dm": "P2122",
		"des": "Drosselklappen-/Pedalsensor/Schaltkreis D zu niedrig",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenaktuator zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung Zu den Fehlerursachen gehören Unterbrechung oder Kurzschluss im Stromkreis des Gaspedalpositionssensors (APP), Fehler des APP-Sensors selbst, Fehler des elektronischen Steuermoduls (PCM oder ECM) usw. "
	},
	"P2183": {
		"zzs": "Alle Autohersteller",
		"dm": "P2183",
		"des": "Motorkühlmitteltemperatursensor 2, Schaltkreisbereich/Leistung",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Motorkühlmitteltemperatursensor (ECT) überträgt die Temperatur des Motorkühlmittels in Form eines elektrischen Signals an das elektronische Steuergerät (ECU) über das Thermistorprinzip als Grundlage für die Korrektur der Kraftstoffeinspritzung und Zündung."
	},
	"P2293": {
		"zzs": "Alle Autohersteller",
		"dm": "P2293",
		"des": "Kraftstoffdruckregler 2 Leistung",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Der Kraftstoffdruckregler verwendet ein federgetriebenes Ventil, um überschüssiges Benzin zurück in den Tank zu leiten und hält so den Druck im Kraftstoffkreislauf konstant unterschiedlichen Motorbetriebsbedingungen (Beurteilung der Motorlast anhand des Vakuumgrads). Die Kraftstoffdruckregler der meisten Autos befinden sich am Kraftstoffabzweigrohr, aber die Kraftstoffdruckregler einiger Autos befinden sich im Kraftstofftank. "
	},
