	"P2080": {
		"zzs": "Alle Autohersteller",
		"dm": "P2080",
		"des": "Bereich/Leistung des Schaltkreises des Abgastemperatursensors (Bank 1 Sensor 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Funktion des Abgastemperatursensors besteht darin, die Abgastemperatur in Form eines elektrischen Signals an die elektronische Steuereinheit (ECU) zu senden. Die durch das richtige Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur ist höher niedriger als die durch zu fettes oder zu mageres Luft-Kraftstoff-Verhältnis erzeugte Abgastemperatur. Niedrige Lufttemperatur. Überhöhte Abgastemperatur (>160 °C) kann den Motor beschädigen."
	},
	"P2208": {
		"zzs": "Alle Autohersteller",
		"dm": "P2208",
		"des": "NOx-Sensor Heizkreis (Bank 1)",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "Die Aufgabe des Stickoxidsensors besteht darin, den Stickoxidgehalt im Abgas in Form eines elektrischen Signals an das Powertrain Control Module (PCM) zu übermitteln und so eine Rückmeldung für die Verbrennung zur Reduzierung des Stickstoffgehalts zu geben oxidische Schadstoffemission."
	},
	"P2101": {
		"zzs": "Alle Autohersteller",
		"dm": "P2101",
		"des": "Drosselklappenstellglied A Regelmotor Schaltkreis Bereich/Leistung",
		"sys": "Kraftstoff-, Luft- oder Emissionskontrolle",
		"zs": "In der elektronischen Drosselklappensteuerung (ETC) besteht die Rolle des Gaspedalpositionssensors (APP) darin, die Position des Gaspedals in Form eines elektrischen Signals an das Drosselklappensteuermodul zu übertragen Drosselklappenstellglied zur Steuerung der Drosselklappe Referenzbasis für die Ventilöffnung.Das Drosselklappenstellglied ist ein Schrittmotor, der für die Steuerung der Drosselklappenöffnung gemäß den Anweisungen des Drosselklappensteuermoduls verantwortlich ist.Dieser Fehlercode zeigt an, dass das elektronische Steuermodul erkennt, dass die Stromkreisspannung des Drosselklappenstellglieds steuert den Motor (TACM) außerhalb des normalen Bereichs liegt Fehlerursachen umfassen Stromkreis- oder Steckerfehler des Drosselklappenstellmotors (TACM), Fehler der TACM-Baugruppe, Fehler des elektronischen Steuermoduls (PCM oder ECM) usw. "
	},
