		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Rolle der Nockenwelle besteht darin, das Öffnen und Schließen des Ventils zu steuern. Bei der variablen Ventilsteuerung ändert das elektronische Nockenwellenregelventil (oder Oil Control Valve, OCV) den Winkel der Nockenwelle mittels Öldruck zum Nockenwellenversteller (mechanisch), um sicherzustellen, dass das Ventil zum optimalen Zeitpunkt öffnet und schließt.Die Rolle des Nockenwellenpositionssensors (CMP) besteht darin, die Einstellung der Nockenwellenposition (die relative Position) an die zu übertragen Electronic Control Unit (ECU) in Form eines Spannungssignals."
