		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Rolle der Zündspule besteht darin, die 12-Volt-Spannung der Autobatterie in Tausende oder sogar Zehntausende von Volt umzuwandeln, die für die Zündkerzenzündung erforderlich sind. Es gibt zwei Spulensätze in der Zündspule, die Primärspule und Sekundärspule. Die Primärspule hat dickeren Lackdraht mit weniger Windungen; die Sekundärspule verwendet dünneren Lackdraht, der relativ mehr Windungen hat. Wenn die Primärspule eingeschaltet wird, wird um sie herum ein starkes Magnetfeld erzeugt Strom steigt und der Eisenkern speichert Magnetfeldenergie; wenn das Schaltgerät den Primärspulenkreis öffnet, fällt das Magnetfeld der Primärspule schnell ab und eine hohe Spannung wird in der Sekundärspule induziert."
