	"P3027": {
		"zzs": "Audi, Volkswagen",
		"dm": "P3027",
		"des": "Drosselklappensteuerkreis, Sensor 1 - Signal High",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Im elektronischen Drosselklappensystem (ETC) befiehlt das elektronische Steuermodul (ECU) die Drosselklappenstellung Motor Envoy gemäß dem Signal des Gaspedalstellungssensors (APP) und der Motordrehzahl, Fahrzeuggeschwindigkeit, Klimaanlage Energieverbrauch usw. Die Ventilöffnung ist optimal."
	},
	"P3283": {
		"zzs": "mini",
		"dm": "P3283",
		"des": "Kraftstoffverteilerdrucksensor - Kraftstoffvolumensignal außerhalb des Bereichs",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Der Kraftstoffdruckregler verwendet ein federgetriebenes Ventil, um überschüssiges Benzin zurück in den Tank zu leiten und hält so den Druck im Kraftstoffkreislauf konstant unterschiedlichen Motorbetriebsbedingungen (Beurteilung der Motorlast anhand des Unterdrucks).Die Kraftstoffdruckregler der meisten Autos befinden sich am Kraftstoffabzweigrohr, aber die Kraftstoffdruckregler einiger Autos befinden sich im Kraftstofftank.Der Kraftstoffdrucksensor misst den Kraftstoffdruck in der Nähe des Einspritzventils. Das elektronische Steuergerät (ECU) verwendet dieses Signal, um die Impulsbreite des Einspritzventils einzustellen und die Kraftstoffmenge zu messen, die in den Brennraum gelangt."
	},
	"P3245": {
		"zzs": "Benz",
		"dm": "P3245",
		"des": "Beheizter Sauerstoffsensor 3 - Masseschluss",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Die Funktion des Sauerstoffsensors besteht darin, den Sauerstoffgehalt im Abgas des Motors zu messen, um die Kraftstoffeinspritzmenge zu korrigieren, damit der Motor das beste Luft-Kraftstoff-Verhältnis erzielen kann. Im OBD-Fehlercode, Sie werden oft die Anzahl der Reihen und Zahlen sehen Lambdasonde. Reihe 1 bezieht sich auf die Reihe, in der sich Zylinder 1 befindet, und die verbleibende Reihe ist Reihe 2. Egal in welcher Reihe, die erste Sonde bezieht sich immer auf die vorgeschaltete Lambdasonde (vorher dem Katalysator), der zweite Sensor ist immer die nachgeschaltete Lambdasonde (nach dem Katalysator)."
	},
	"P3093": {
		"zzs": "Audi, Volkswagen",
		"dm": "P3093",
		"des": "Motorsteuergerät (ECM) - Interner Fehler",
		"sys": "Antriebssystem (vom Hersteller definiert)",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts des Motors. Eine weitere wichtige Rolle spielt die für die Überwachung der Abgasreinigung zuständige Komponente."
	},
