	"U2106": {
		"zzs": "GM, GM, Buick, Chevrolet, Cadillac, Hummer, Goldpokal",
		"dm": "U2106",
		"des": "Engine Control Module (ECM)/Transmission Control Module (TCM)/Fuel Injector Control Module (FICM), CAN-Datenbus - Kommunikationsstörung",
		"sys": "Netzwerkkommunikationssystem",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist Zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts für den Motor Eine weitere wichtige Rolle stellt die für die Überwachung der Abgasemissionskontrolle zuständige Komponente dar. Das Transmission Control Module (TCM oder TCU) hilft dem Getriebe bei der Entscheidung, wann und wie geschaltet werden soll Lassen Sie das Auto die Leistung verbessern, reibungslos schalten und Kraftstoff sparen.Controller Area Network (CAN) (Controller Area Network, kurz CAN oder CAN-Bus) ist ein Automobil-Kommunikationsprotokoll, das dadurch gekennzeichnet ist, dass es Netzwerkgeräten ermöglicht, direkt miteinander zu kommunizieren andere, und der Host muss die Kommunikation im Netzwerk nicht steuern."
	},
	"U1135": {
		"zzs": "Ford, Mercury, Lincoln",
		"dm": "U1135",
		"des": "CAN-Datenbus, Motorsteuergerät (ECM) - Zündschalter ungültige oder fehlende Daten",
		"sys": "Netzwerkkommunikationssystem",
		"zs": "Controller Area Network (CAN) (kurz CAN oder CAN-Bus) ist ein Automobil-Kommunikationsprotokoll, das sich dadurch auszeichnet, dass Geräte im Netzwerk direkt miteinander kommunizieren können, ohne dass eine Host-Steuerungskommunikation auf dem erforderlich ist Motor Das Steuergerät, auch Motorsteuergerät genannt (bei manchen Autos sind das Motorsteuergerät und das Getriebesteuergerät in ein Antriebsstrangsteuergerät integriert), steuert den Betrieb des gesamten Motors.Seine Hauptfunktion ist die Steuerung die optimale Kraftstoffeinspritzung des Motors und Zündzeitpunkt.Eine weitere wichtige Rolle ist die Überwachung der Komponenten der Abgasreinigung.Der Zündschalter hat zwei Hauptfunktionen: 1) Ermöglicht dem Fahrer, die Stromversorgung zu verschiedenen Zubehörteilen zu steuern, um so zu vermeiden die Batterieleistung entleert wird, nachdem der Motor abgestellt wurde; 2) Wenn das Auto anspringt, schließen Sie die Batterie an den Starter an Der Netzschalter hat im Allgemeinen vier Gänge: AUS (OFF), Zubehör (ACC), EIN (ON) und ANFANG (ANFANG)."
	},
