		"des": "Kommunikation zwischen ECM und Multifunktionssteuergerät - kein Signal",
		"sys": "Netzwerkkommunikationssystem",
		"zs": "Das Motorsteuergerät, auch als Motorsteuergerät bekannt (einige integrierte Motorsteuergeräte und Getriebesteuermodule sind in ein Antriebsstrangsteuermodul integriert), steuert den Betrieb des gesamten Motors. Seine Hauptfunktion ist zur Steuerung der optimalen Kraftstoffeinspritzmenge und des Zündzeitpunkts des Motors Eine weitere wichtige Rolle ist die Überwachung der Komponenten der Abgasreinigung Die Rolle des Multifunktionssteuermoduls besteht darin, viele allgemeine Aufgaben zu steuern, wie z.B. Innenbeleuchtung, Radio , Blinker usw. Es wird von vielen verwendet. Die vom Funktionssteuermodul gesteuerten Elemente sind von Auto zu Auto sehr unterschiedlich."
