	"U1098": {
		"zzs": "Ford, Mercury, Lincoln",
		"dm": "U1098",
		"des": "CAN-Datenbus, Antiblockiersystem (ABS) - Fahrzeuggeschwindigkeit ungültig oder fehlende Daten",
		"sys": "Netzwerkkommunikationssystem",
		"zs": "Controller Area Network (CAN) (kurz CAN oder CAN-Bus) ist ein Automobil-Kommunikationsprotokoll, das sich dadurch auszeichnet, dass Geräte im Netzwerk direkt miteinander kommunizieren können, ohne dass ein Host die Kommunikation steuern muss Die Funktion des Feststellbremssystems (ABS) besteht darin, ein Blockieren der Räder zu verhindern, damit das Auto im Bremszustand noch lenken kann, um die Stabilität der Bremsrichtung des Autos sicherzustellen und einen Seitenschlupf zu verhindern und Abweichung."
	},
	"U1125": {
		"zzs": "mini",
		"dm": "U1125",
		"des": "Elektronisches Stabilitätsprogramm Steuergerät - Meldungsüberwachung, Selbsttest",
		"sys": "Netzwerkkommunikationssystem",
		"zs": "Das elektronische Stabilitätssystem integriert ABS (Antiblockiersystem), BAS (Bremsassistenzsystem) und ASR (Beschleunigungs-Antiblockiersystem) drei Systeme, die leistungsstärker sind. Diese Gruppe von Systemen ist normalerweise es unterstützt die Funktionen von ABS und ASR (Antriebs-Antiblockiersystem, auch bekannt als Traktionskontrollsystem). Es hilft dem Fahrzeug, das dynamische Gleichgewicht zu halten, indem es die Fahrzustandsinformationen des Fahrzeugs von verschiedenen Sensoren analysiert und dann Korrekturbefehle an ABS und ASR sendet. ESP ermöglicht es dem Fahrzeug, unter allen Bedingungen eine optimale Stabilität beizubehalten, insbesondere in Über- oder Untersteuersituationen."
	},
